(38, 'Nawa CIta', 'nawa-cita', '<ol>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Menghadirkan kembali negara untuk melindungi segenap bangsa dan memberikan rasa aman pada seluruh warga negara, melalui politik luar negeri bebas aktif, keamanan nasional yang terpercaya dan pembangunan pertahanan negara Tri Matra terpadu yang dilandasi kepentingan nasional dan memperkuat jati diri sebagai negara maritim.</font></span></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Membuat pemerintah tidak absen dengan membangun tata kelola pemerintahan yang bersih, efektif, demokratis, dan terpercaya, dengan memberikan prioritas pada upaya memulihkan kepercayaan publik pada institusi-institusi demokrasi dengan melanjutkan konsolidasi demokrasi melalui reformasi sistem kepartaian, pemilu, dan lembaga perwakilan.</font></span></li>\r\n	<li style="text-align: justify"><font size="3"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px">Membangun Indonesia dari pinggiran dengan memperkuat daerah-daerah dan desa dalam kerangka negara kesatuan.</span><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px">&nbsp;</span></font></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Menolak negara lemah dengan melakukan reformasi sistem dan penegakan hukum yang bebas korupsi, bermartabat, dan terpercaya.</font></span></li>\r\n	<li style="text-align: justify"><font size="3"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px">Meningkatkan kualitas hidup manusia Indonesia melalui peningkatan kualitas pendidikan dan pelatihan dengan program &quot;Indonesia Pintar&quot;; serta peningkatan kesejahteraan masyarakat dengan program &quot;Indonesia Kerja&quot; dan &quot;Indonesia Sejahtera&quot; dengan mendorong&nbsp;</span><em style="box-sizing: border-box; color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px">land reform</em><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px">&nbsp;dan program kepemilikan tanah seluas 9 hektar, program rumah kampung deret atau rumah susun murah yang disubsidi serta jaminan sosial untuk rakyat di tahun 2019.</span></font></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Meningkatkan produktivitas rakyat dan daya saing di pasar internasional sehingga bangsa Indonesia bisa maju dan bangkit bersama bangsa-bangsa Asia lainnya.</font></span></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Mewujudkan kemandirian ekonomi dengan menggerakkan sektor-sektor strategis ekonomi domestik.</font></span></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Melakukan revolusi karakter bangsa melalui kebijakan penataan kembali kurikulum pendidikan nasional dengan mengedepankan aspek pendidikan kewarganegaraan, yang menempatkan secara proporsional aspek pendidikan, seperti pengajaran sejarah pembentukan bangsa, nilai-nilai patriotisme dan cinta Tanah Air, semangat bela negara dan budi pekerti di dalam kurikulum pendidikan Indonesia.</font></span></li>\r\n	<li style="text-align: justify"><span style="color: #4b4b4b; font-family: Lucida, helvetica, sans-serif; line-height: 24px"><font size="3">Memperteguh kebhinnekaan dan memperkuat restorasi sosial Indonesia melalui kebijakan memperkuat pendidikan kebhinnekaan dan menciptakan ruang-ruang dialog antarwarga.</font></span></li>\r\n</ol>\r\n', '94jokowi jk.jpg', 'Y', 818, '2015-12-12', '16:40:39', 'Sabtu', 'admin'),
