(45, 'Latprostaf', 'latprostaf', '<div align="justify">\r\n<span class="fontstyle0">Waket Bidang Akademik Brigjen Pol Drs. Bima Anggara Sena, MH pada hari Kamis 2 Februari 2017 mewakili</span><span class="fontstyle0"> Ketua STIK membuka Pelatihan Prosedur Staf bagi Mahasiswa STIK Program S1 Angk. Ke-70 di ruang</span><span class="fontstyle0"> Auditorium STIK. Kegiatan Latprostaf dilaksanakan/diberikan pada Mahasiswa STIK yang merupakan </span><span class="fontstyle0">Simulasi dilapangan dan kelak menjadi bekal nyata dalam pelaksanaan tugas pada tingkat polres. </span><span class="fontstyle0">Latprostaf pun merupakan bentuk praktek dari hasil pendidikan ilmu yang diberikan dosen pada </span><span class="fontstyle0">Mahasiswa selama belajar di STIK. Pelaksanaan Latprostaf selalu dibimbing dan diarahkan oleh Patun </span><span class="fontstyle0">dan Pembimbing yang memang telah dan pernah menjabat sebagai Kapolres, sehingga Penerapan </span><span class="fontstyle0">Pengalaman Kepemimpinan dari para Pembina amat sangat berpengaruh besar dan menambah ilmu </span><span class="fontstyle0">yang akan diterapkan kelak pada saat Mhsw. Telah menduduki jabatan tertentu ditingkat polres.</span><br />\r\n</div>\r\n \r\n', '', 'Y', 13, '2017-02-02', '09:13:57', 'Kamis', 'bhinaya');
