INSERT INTO `berita` (`id_berita`, `id_kategori`, `username`, `judul`, `sub_judul`, `youtube`, `judul_seo`, `headline`, `aktif`, `utama`, `isi_berita`, `keterangan_gambar`, `hari`, `tanggal`, `jam`, `gambar`, `dibaca`, `tag`) VALUES
(666, 67, 'admin', 'BAKTI SOSIAL MAHSISWA KEPOLISIAN STIK â€“ PTIK ANGKATAN 70 ', '', '', 'bakti-sosial-mahsiswa-kepolisian-stik-â€“-ptik-angkatan-70-', 'Y', 'N', 'Y', '<div>\r\n<font size="3">Bogor MPP - Beberapa perwira pertama mahasiswa angkatan 70/2015. Di STIK â€“ PTIK Jalan Trunojoyo Jakarta Selatan ini, diantaranya sodara Akp Jamalinus nababan Akp Maulana mukarom Akp Clief gerald p duith dan Iptu Syarul alim, berkunjug di yayasan yatim piatu BINA HARAPAN yang berdomisili di jln jend sudirman Bogor.</font>\r\n</div>\r\n<div>\r\n<font size="3">Tutur kata yang di wakili (bpk. AKP Jamalius nababan SH) berkunjung di panti asuhan ini hanya ingin berbagi rizki bersama sodara-sodara kami yang ada di Panti Asuhan bina harapan ini,</font>\r\n</div>\r\n<div>\r\n<font size="3">Setibanya di tempat panti asuhan ini saya dan rekan-rekan mahasiswa STIK-PTIK angkatan 70/2015 ini sangat senang dengan penyambutanya saudara-saudara adik kami yang ada di Panti Asuhan sehingga bisa bermain ceria bersamanya, (Za)</font>\r\n</div>\r\n<div>\r\nÂ \r\n</div>\r\n<div>\r\nhttp://www.mediapurnapolri.com/misi-bakti-sosial-mahsiswa-kepolisian-stik-ptik-angkatan-70-widya-arga-guna-2015/Â \r\n</div>\r\n', '', 'Kamis', '2015-12-24', '20:17:39', '75zainul.jpg', 5125, ''),
(686, 66, 'bhinaya', 'Latprostaf Mahasiswa Angkatan 70', '', '', 'latprostaf-mahasiswa-angkatan-70', 'Y', 'Y', 'Y', '<div align="justify">\r\nWaket Bidang Akademik Brigjen Pol Drs. Bima Anggara Sena, MH pada hari Kamis 2 Februari 2017 mewakili Ketua STIK membuka Pelatihan Prosedur Staf bagi Mahasiswa STIK Program S1 Angk. Ke-70 di ruang Auditorium STIK. Kegiatan Latprostaf dilaksanakan/diberikan pada Mahasiswa STIK yang merupakan Simulasi dilapangan dan kelak menjadi bekal nyata dalam pelaksanaan tugas pada tingkat polres. Latprostaf pun merupakan bentuk praktek dari hasil pendidikan ilmu yang diberikan dosen pada Mahasiswa selama belajar di STIK. Pelaksanaan Latprostaf selalu dibimbing dan diarahkan oleh Patun dan Pembimbing yang memang telah dan pernah menjabat sebagai Kapolres, sehingga Penerapan Pengalaman Kepemimpinan dari para Pembina amat sangat berpengaruh besar dan menambah ilmu yang akan diterapkan kelak pada saat Mhsw. Telah menduduki jabatan tertentu ditingkat polres.\r\n</div>\r\n', '', 'Kamis', '2017-02-02', '09:21:28', '', 1, ''),
