(34, 'Visi dan Misi PTIK menu', 'visi-dan-misi-ptik-menu', '<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong><span style="font-family: &#39;comic sans ms&#39;, cursive">I.&nbsp;&nbsp;&nbsp;</span>&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong><span style="font-family: &#39;comic sans ms&#39;, cursive">VISI, MISI DAN TUJUAN PTIK</span></strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive"><strong>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>&nbsp;VISI PTIK</strong></span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">Visi Sekolah Tinggi Ilmu Kepolisian PTIK adalah menjadi pendidikan tinggi yang dapat dibanggakan dan dapat diandalkan dalam mewujudkan Perwira Sarjana Ilmu Kepolisian yang Profesional dan bermoral serta menjadi Pusat Pengkajian permasalahan kepolisian dan Pengembangan Ilmu dan Teknologi Kepolisian. Menjadi Perguruan tinggi kepolisian yang modern bertaraf internasional dengan kompetensi utama administrasi kepolisian, berkarakter kemandirian dan penggerak perubahan.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive"><strong>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>&nbsp;&nbsp;MISI PTIK</strong></span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">1.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan Pendidikan Tinggi Ilmu Kepolisian yang bermutu tinggi dan memiliki keunggulan serta daya saing dalam pemantapan pembangunan dan pemeliharaan keamanan.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">2.&nbsp;&nbsp;&nbsp;&nbsp; Mengembangkan ilmu dan teknologi kepolisian sesuai tuntutan kebutuhan masyarakat pada masa kini dan masa mendatang.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">3.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pengkajian terhadap masalah-masalah pemolisian dan memberikan rekomendasi akademis dalam rangka perumusan kebijakan.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">4.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pengabdian kepada masyarakat dalam rangka penerapan Ilmu dan Teknologi Kepolisian.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">5.&nbsp;&nbsp;&nbsp;&nbsp; Mempromosikan penyelenggaraan Pendidikan dan Pengembangan Ilmu dan Teknologi Kepolisian pada perguruan tinggi, serta menyiapkan tenaga-tenaga pendidik Ilmu Kepolisian.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">6.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan kerjasama dengan lembaga Pendidikaan Tinggi dan Lembaga-lembaga lain dalam skala Nasional maupun Internasional.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">7.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pembinaan kemahasiswaan yang komprehensif dan kompetitif.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">8.&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan dan pelatihan lainnya secara profesional.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive"><strong>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>&nbsp;TUJUAN PTIK</strong></span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">1.&nbsp;&nbsp;&nbsp;&nbsp; Tujuan Umum</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">Meningkatkan kemampuan anggota Polri dan hasil didik lainnya yang berwawasan ilmiah, bermoral dan mampu melaksanakan tugas secara profesional di bidang Pemeliharaan Keamanan dan Ketertiban Masyarakat, Penegakan Hukum serta Perlindungan, Pengayoman dan Pelayanan kepada masyarakat.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">2.&nbsp;&nbsp;&nbsp;&nbsp; Tujuan Khusus</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">a)&nbsp;&nbsp;&nbsp;&nbsp; Meningkatkan kemampuan para perwira Polri lulusan Akademi Kepolisian yang berkualifikasi sarjana, memiliki wawasan ilmiah, bermoral dan&nbsp; profesional sebagai praktisi dan asisten manajer tingkat menengah dalam melaksanakan tugas kepolisian.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">b)&nbsp;&nbsp;&nbsp;&nbsp; Meningkatkan kemampuan anggota Polri, yang memiliki wawasan ilmiah, bermoral dan&nbsp; profesional sebagai praktisi dalam pelaksanaan fungsi kepolisian.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">c)&nbsp;&nbsp;&nbsp;&nbsp; Mewujudkan sumber daya manusia yang berkualifikasi Sarjana Ilmu Kepolisian yang cerdas, berbudaya, bermoral tinggi, kreatif dan inovatif yang mampu memahami, menerapkan dan mengembangkan ilmu dan teknologi kepolisian.</span>\r\n</p>\r\n<p style="margin: 0px 0px 20px; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<span style="font-family: &#39;comic sans ms&#39;, cursive">Mewujudkan sumber daya perwira Polri yang berwawasan ilmiah, berkualifikasi sarjana, bermoral dan profesional, sebagai praktisi dan asisten manajer tingkat menengah dalam melaksanakan fungsi kepolisian.</span>\r\n</p>\r\n', '2015-10-05', '', 'bhinaya', 376, '01:11:00', 'Senin'),
(37, 'Sejarah Singkat STIK-PTIK menu', 'sejarah-singkat-stikptik-menu', '<p style="margin: 0px 0px 20px; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: center">\r\n<strong>SEKILAS TENTANG PERGURUAN TINGGI ILMU KEPOLISIAN</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPTIK dengan peran sebagai lembaga pendidikan kedinasan dan lembaga pendidikan akademik, mempunyai jati diri sebagaiÂ <em>Perguruan Tinggi Kedinasan Kepolisian Republik Indonesia yang bertujuan mengembangkan Ilmu Kepolisian di Indonesia</em>. Untuk mewujudkan hal tersebut, senantiasa dilakukan usaha-usaha maksimal untuk meningkatkan kualitas proses belajar-mengajar (akademik) dan kualitas kelembagaan Sekolah Tinggi Ilmu Kepolisian â€œPTIKâ€, sehingga lembaga ini mampu meluluskan perwira-perwira dengan kualitas terbaik untuk memenuhi kebutuhan masyarakat, bangsa, dan Negara Indonesia.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>I.Â Â Â Â Â Â Â </strong><strong>LINTAS SEJARAH SINGKAT PTIK</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPada tanggal 18 Agustus 1945 di bentuk Badan Kepolisian Negara berdasarkanmaklumat pemerintah, pada tanggal 29 September 1945 di lantik Kepala Kepolisian Negara yang pertama R.S. SoekantoPada tanggal17 Juli 1946 dengan Ketetapan Pemerintah No. 11/SD/1946 dibentuk Jawatan Kepolisian Negara yang di pimpin oleh Kepala Kepolisian Negara dan bertanggung jawab langsung kepada Perdana Menteri(Hari yang monumental ini selanjutnya di peringati sebagai hariBhayangkara). Semua Fungsi Kepolisian disatukan dalam jawatan Kepolisian Negara yang memimpin Kepolisian di seluruh tanah air.Pada tanggal 17 Juni 1946Â  dibentuksekolah Kepolisian Negara pada bagian tinggi di Mertoyudan yang selanjutnya berproses dan berkembang menjadi Akademi Polisi dan berdasarkan Surat Keputusan Perdana Menteri Momor : 47/PM/II/50 tanggal 1 September 1950 secara resmi nama Akademi Polisi diubah menjadi Perguruan Tinggi Ilmu Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPenataan lembaga PTIK terus dilakukan danditingkatkan, denganÂ  Surat Keputusan Perdana Menteri Nomor : 87/PM/II/1954 tanggal 20 Agustus 1954 telah membagi pendidikan/pengajaran dalam 2 (dua) bagian, meliputi : bagian â€œpersiapanâ€ PTIK atau Bakaloreat selama 3 tahun dan bagian Â â€œkeahlianâ€ (doktoral) selama 2 (dua) tahun.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPerkembangan lebih lanjut kampus PTIK dari martoyudan di pindahkan keJogyakarta, beberapa tahun kemudian Kampus PTIK di pindahkan ke jalan Tambak no. 2 Jakarta. Selanjutnya pada tahun 1963Â  Kampus PTIK dipindahkan ke Pasar Jumâ€™at dan menempati gedung Deplat 007 Ciputat, hingga tahun 1971 PTIK kemudian kampus PTIK berpindah lagi ke Jl.Tirtayasa No.6 Kebayoran Baru Jakarta Selatan hingga saat ini. Pada tahun 1976 Â organisasi dan prosedur PTIK terjadi perubahan yang isinya bahwa Perguruan Tinggi Ilmu Kepolisian merupakan lembaga pendidikan struktural berkedudukan dibawah dan tanggung jawab kepada Kapolri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nBerdasarkan Surat Keputusan Bersama Menteri Pendidikan dan KebudayaanÂ <em>dan</em>Â Kepala Kepolisian Republik Indonesia Nomor 0214/O/1980 dan Nomor Kep/12/VII/80, PTIK merupakan Perguruan Tinggi Kedinasan dari Kepolisian Republik Indonesia. Tanggung jawab atas pembinaan dan pengembangan aspek akademik dari pendidikan tinggi PTIK dilaksanakan oleh Menteri Pendidikan Nasional, sedangkan dari aspek pembinaan sumberdaya dibawah kendali Kapolri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPerkembangan organisasi PTIK selanjutnya diatur berdasarkan Surat Keputusan Kapolri No. Pol : Kep/09/X/1984 tanggal 30 Oktober 1984 lampiran â€œZâ€ tentang pokok-pokok organisasi Prosedur bahwa PTIK merupakan badan penyelenggara dan pelaksana pendidikan dan pengembangan ilmu dan teknologi Kepolisian bagi para perwira Polri yang berkedudukan di bawah Kapolri. Penyelenggaraan pendidikan tinggi bidang ilmu dan teknologi Kepolisian, baik untuk jalur gelar maupun non gelar, yang meliputi :\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na.Â Â Â Â Â  Â Â Pendidikan dan pengajaran termasuk pembinaan mental kepribadian dan kesamaptaan;\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb.Â Â Â Â Â  Â Â Penelitian dan pengembangan;\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nc.Â Â Â Â Â  Â Â Pengabdian masyarakat.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nBerdasarkan Surat Keputusan Kepala Kepolisian Republik Indonesia Nomor Pol: Skep/2002/XII/1994, tentang Statuta PTIK, bahwa PTIK ditetapkan menjadi Sekolah Tinggi Ilmu Kepolisian. Pengembangan lebih lanjut terhadap PTIK, telah dilakukan Restrukturisasi organisasi Sekolah Tinggi Ilmu Kepolisian â€œPTIKâ€ selaras dengan struktur organisasi Perguruan Tinggi Negeri/Swasta. STIK-PTIK telah dan sedang menyelenggarakan program pendidikan disamping Strata satu (S1) Ilmu Kepolisian juga melaksanakan program studi sebagai berikut :\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na.Â Â Â Â Â  Â Â Berdasarkan surat Keputusan Kapolri no pol : Skep/1183/VIII/1994 tanggal 29 Agustus 1994 diselenggarakan pendidikan D-3 Ilmu Kepolisian khusus untuk Polisi wanita di lingkungan Polri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb.Â Â Â Â Â  Â Â Keputusan Mendiknas Nomor : 84/D/O/2010 tanggal 14 Juni 2010, selanjutnya dikuatkan dengan Surat Keputusan Kapolri nomor : Kep/378/VI/2010 tanggal 18 Juni 2010 tentang penyelenggaraan Program Pasca Sarjana (S2) Ilmu Kepolisian STIK-PTIK.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nÂ \r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>II.Â Â Â Â Â Â </strong><strong>VISI, MISI DAN TUJUAN PTIK</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 35.45pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nÂ \r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>a.Â Â Â Â Â Â </strong><strong>Â VISI PTIK</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nVisi Sekolah Tinggi Ilmu Kepolisian PTIK adalah menjadi pendidikan tinggi yang dapat dibanggakan dan dapat diandalkan dalam mewujudkan Perwira Sarjana Ilmu Kepolisian yang Profesional dan bermoral serta menjadi Pusat Pengkajian permasalahan kepolisian dan Pengembangan Ilmu dan Teknologi Kepolisian. Menjadi Perguruan tinggi kepolisian yang modern bertaraf internasional dengan kompetensi utama administrasi kepolisian, berkarakter kemandirian dan penggerak perubahan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>b.Â Â Â Â Â </strong><strong>Â Â MISI PTIK</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â Â Â Â  Menyelenggarakan Pendidikan Tinggi Ilmu Kepolisian yang bermutu tinggi dan memiliki keunggulan serta daya saing dalam pemantapan pembangunan dan pemeliharaan keamanan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â Â  Mengembangkan ilmu dan teknologi kepolisian sesuai tuntutan kebutuhan masyarakat pada masa kini dan masa mendatang.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3.Â Â Â Â  Menyelenggarakan pengkajian terhadap masalah-masalah pemolisian dan memberikan rekomendasi akademis dalam rangka perumusan kebijakan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n4.Â Â Â Â  Menyelenggarakan pengabdian kepada masyarakat dalam rangka penerapan Ilmu dan Teknologi Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n5.Â Â Â Â  Mempromosikan penyelenggaraan Pendidikan dan Pengembangan Ilmu dan Teknologi Kepolisian pada perguruan tinggi, serta menyiapkan tenaga-tenaga pendidik Ilmu Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n6.Â Â Â Â  Menyelenggarakan kerjasama dengan lembaga Pendidikaan Tinggi dan Lembaga-lembaga lain dalam skala Nasional maupun Internasional.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n7.Â Â Â Â  Menyelenggarakan pembinaan kemahasiswaan yang komprehensif dan kompetitif.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n8.Â Â Â Â  Menyelenggarakan pendidikan dan pelatihan lainnya secara profesional.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>c.Â Â Â Â Â Â </strong><strong>Â TUJUAN PTIK</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â Â Â Â  Tujuan Umum\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nMeningkatkan kemampuan anggota Polri dan hasil didik lainnya yang berwawasan ilmiah, bermoral dan mampu melaksanakan tugas secara profesional di bidang Pemeliharaan Keamanan dan Ketertiban Masyarakat, Penegakan Hukum serta Perlindungan, Pengayoman dan Pelayanan kepada masyarakat.\r\n</p>\r\n<p style="margin: 0px 0px 20px 63.8pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â Â  Tujuan Khusus\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na)Â Â Â Â  Meningkatkan kemampuan para perwira Polri lulusan Akademi Kepolisian yang berkualifikasi sarjana, memiliki wawasan ilmiah, bermoral danÂ  profesional sebagai praktisi dan asisten manajer tingkat menengah dalam melaksanakan tugas kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb)Â Â Â Â  Meningkatkan kemampuan anggota Polri, yang memiliki wawasan ilmiah, bermoral danÂ  profesional sebagai praktisi dalam pelaksanaan fungsi kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nc)Â Â Â Â  Mewujudkan sumber daya manusia yang berkualifikasi Sarjana Ilmu Kepolisian yang cerdas, berbudaya, bermoral tinggi, kreatif dan inovatif yang mampu memahami, menerapkan dan mengembangkan ilmu dan teknologi kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 85.05pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nd)Â Â Â Â  Mewujudkan sumber daya perwira Polri yang berwawasan ilmiah, berkualifikasi sarjana, bermoral dan profesional, sebagai praktisi dan asisten manajer tingkat menengah dalam melaksanakan fungsi kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>III.Â Â Â Â </strong><strong>KEGIATAN PENDIDIKAN DAN PENGEMBANGAN ILMU KEPOLISIAN</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 35.45pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â  Pendidikan Program Sarjana (S1) Ilmu Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na.Â Â Â  Program studi Strata Satu (S1) Ilmu Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1)Â Â Â  Menyelenggarakan Pendidikan Program Jarak Jauh (PPJJ) out kampus selama 5 (lima) Bulan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2)Â Â Â  Pendidikan on kampus selama 11 (sebelas) Bulan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3)Â Â Â  Untuk program pendidikan T.A. 2010-2011 dan seterusnya tidak lagi menyelenggarakan PPJJ akan tetapi seluruh kegiatan dilaksanakan on kampus selama 4 semester (18 Bulan).\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n4)Â Â Â  Untuk T.A. 2011-2012 jumlah mahasiswa PTIK per angkatan sebanya 150 mahasiswa.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb.Â Â Â  Program studi Pasca Sarjana (S2) Ilmu Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1)Â Â Â  Saat ini sedang dalam proses persiapan kurikulum, sarana dan fasilitas pendidikan dosen matakuliah, tenaga kependidikan, dan komponen pendidikan lainnya.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2)Â Â Â  Susun rencana kegiatan sosialisasi penyelenggaraan Program Pasca Sarjana (S2) Ilmu Kepolisian dengan target Internasional dan Eksternal.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3)Â Â Â  Menjalin kerjasama dengan PTN/PTS dan pihak terkait.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â Â Â  Penelitian dan Pengembangan Ilmu dan Teknologi Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na.Â Â Â  Menyusun rencana kegiatan penelitian dan pengembangan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb.Â Â Â  Menyelenggarakan kegiatan penelitian, untuk T.A. 2010 telah ditetapkan 8 program penelitian dengan anggaran DIPA PTIK dan 2 program swadaya.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nc.Â Â Â  Menerbitkan hasil penelitian dalam bentuk :\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1)Â Â Â  PTIK Press\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2)Â Â Â  Jurnal Ilmu Kepolisian STIK-PTIK.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3)Â Â Â  Laporan hasil penelitian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 74.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n4)Â Â Â  Buku Reformasi, disebar luaskan kepada masyarakat.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nd.Â Â Â  Menyelenggarakan seminar sekolah, seminar Nasional dan berbagai kegiatan pertemuan ilmiah.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\ne.Â Â Â  Melakukan kerjasama dengan berbagai pihak dalam pengembangan pendidikan dan pengkajian Ilmu dan Teknologi Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3.Â Â Â Â Â  Pengabdian Masyarakat.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\na.Â Â Â  Merencanakan kegiatan pengabdian masyarakat.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nb.Â Â Â  Melaksanakan dan mengendalikan kegiatan pengabdian masyarakat dalam rangka penerapan dan pemanfaatan Ilmu Kepolisian sebagai bagian dari Tri Dharma Perguruan Tinggi.\r\n</p>\r\n<p style="margin: 0px 0px 20px 56.7pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nc.Â Â Â  Melakukan kerja sama dengan pihak-pihak terkait.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n<strong>IV.Â Â Â </strong><strong>PENGEMBANGAN PTIK KE DEPAN MENUJUÂ </strong><strong>CENTER OF EXCELLENCE</strong>\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nKeunggulan suatu perguruan tinggi terutama terletak pada keunggulan sivitas akademikanya beserta pengorganisasiannya. Walaupun kepakaran melekat pada perorangan, namun pengorganisasian dirinya dapat melahirkan pakar-pakar baru dalam bidangnya yang lebih mutakhir dalam keilmuannya. Bahkan terdapat kemungkinan kepakaran baru sebagai hasil pengembangan kepakaran yang telah ada. Kelahiran, pertumbuhan, pencapaian kedewasaan dan kematian adalah hal alamiah yang akan dialami oleh seseorang maupun lembaga. Namun demikian, kepakaran tidak akan mati apabila dalam menuju kedewasaannya, tumbuh tunas-tunas baru dengan berbagai kelebihan dan kekurangannya, yang akan menjadi penerus dan pengembang kepakaran. Demikian pula suatu lembaga, pencapaian kedewasaan dan kemampuan adalah tanda harus adanya pembaharuan.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nBanyak pendapat pakar pendidikan yang mengidealisasikan pendidikan tinggi sebagai pusat keunggulan, atauÂ <em>Center of Excellence</em>. Dalam hal ini mungkin kita bisa mencari padanan kisahnya di dunia olahraga. Konon, seorang pelatih bulutangkis bertanya secara oratoris kepada anak asuhnya: mengapa bulutangkis Jerman yang didukung oleh litbang dan aplikasi teknologi mutakhir toh tak bisa terangkat prestasinya di tingkat dunia, sementara bulutangkis di Indonesia yang didukung oleh dana terbatas dan doa syafaat rakyatnya, justru berhasil merambah dunia selama puluhan tahun? Sebaliknya, mengapa Indonesia yang berpenduduk lebih dari 200 juta orang ini sulit mencari 11 pemain sepakbola, sementara Jerman yang berpenduduk hanya puluhan juta bisa melahirkan ratusan pesepakbola yang berkualitas dunia?\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nSecara dogmatis-hipotetis lontaran pertanyaan itu dijawab sendiri oleh sang pelatih: tulang bangsa Jerman cocok untuk sepakbola, tidak untuk bulutangkis. Sementara tulang bangsa Indonesia cocok untuk bulutangkis, tidak untuk sepakbola! Sebagai dogma, kebenaran di atas mungkin terpaksa harus kita terima, karena memang kenyataannya demikian. Demikian pula sebagai hipotesa, jawaban tersebut dianggap benar walaupun masih perlu dibuktikan secara empiris. Oleh karena itu, dipandang tepat jika kita selalu mengkaji faktor-faktor keunggulan yang sesuai dengan â€˜tulangâ€™ dunia pendidikan kita, guna pemantapan eksistensinya sebagaiÂ <em>center of excellence</em>.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nDengan merujuk pada pemahaman tersebut, maka PTIK sebagai lembaga pendidikan kedinasan Polri untuk bisa menuju pada posisi sebagai centre of excellence harus melewati berbagai upaya persiapan pada suatu masa transisi. Persiapan tersebut terdiri atas berbagai kegiatan yang meliputi:\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â Â Â Â Â  Â Â PenentuanÂ <em>baselin</em>e PTIK melalui Evaluasi Pelaksanaan Pendidikan di PTIK yangÂ  menyangkut penyelenggaraan kegiatan Tri Dharma Perguruan Tinggi dan kebutuhan organisasi dalam hal ini Polri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â Â Â  Â Â Perumusan kompetensi strategis PTIK dan strategi PTIK dalam berperanserta membangun bangsa dalam hal ini terkait dengan Grand Strategy Polri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3.Â Â Â Â Â  Â Â PenyiapanÂ <em>New Capacity BuildingÂ </em>melalui Peningkatan Keberdayaan Keilmuan, Kepakaran dan Kelembagaan berbasis sinergi dalam jaringan kerjasama.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n4.Â Â Â Â Â  Â Pengembangan Sistem dan Standar Proses Pembelajaran, R-D&E, Pemberdayaan Masyarakat, Karier dan Remunerasi yang meliputi metodologi dan manajemennya, melalui pemodelan dan penelitian yang berkaitan dengan kegiatan kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n5.Â Â Â Â Â  Â Peningkatan keberdayaan sivitas akademika dan sarana akademik (untuk menentukanÂ <em>Driving Force);</em>\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nOleh karena itu Center of Excellence (pusat keunggulan) haruslah memiliki standar kinerja (<em>Key Performance Indicator</em>Â atau KPI) yang unggul. Semua sasaran kerja dibuat setinggi mungkin, dan tidak ada toleransi. Misalnya, nilai dalam proses pendidikan dibuat dengan standar tinggi, tidak ada katrol nilai alias toleransi. Prinsipnya adalah, untuk mencapai keunggulan, dibutuhkan standar yang tinggi, dan tidak ada toleransi mengenai hal ini. SebagaiÂ <em>Center of Excellence</em>Â (pusat keunggulan), PTIK juga harus mampu membuat standar yang tinggi untuk proses pendidikan personel Polri, tanpa ada toleransi. sehingga hasil yang betul-betul personel atau SDM Polri yang berkualitas tinggi.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nDari berbagai literatur, dapat disimpulkan bahwa ada 6 (enam) ciri khas dari sebuah Center of Excellence (pusat keunggulan), yaitu:\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â Â Â Â Â  Â Membentuk kader personel atau SDM yang unggul.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â Â Â  Â Menjadi pusat rujukan atau acuan jika ada masalah di organisasi.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3.Â Â Â Â Â  Â Memiliki standar kinerja (<em>key performance indicator</em>Â /KPI) yang unggul.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n4.Â Â Â Â Â  Â Memiliki proses kerja yang unggul.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n5.Â Â Â Â Â  Â Dijalankan oleh personel atau SDM yang unggul.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n6.Â Â Â Â Â  Â Memiliki budaya organisasi yang unggul.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nDalam kaitan dengan posisi PTIK, maka sebagaiÂ <em>Center of Ex</em>cellence (pusat keunggulan) harus mampu menjadi pusat rujukan atau acuan jika ada masalah yang ada di dalam organisasi. Ini berarti,Â <em>Center of Excellence</em>Â (pusat keunggulan) harus memiliki banyak perpustakaan atau pengetahuan yang bisa dijadikan referensi atau acuan dalam menjalankan organisasi, termasuk mengadakan berbagai riset-riset yang mutakhir sesuai dengan bidangnya. Khusus untuk Polri, maka PTIK sebagaiÂ <em>Center of Excellence</em>) harus memiliki banyak buku, jurnal, tulisan, atau pun berbagai sumber referensi lainnya mengenai berbagai praktek kepolisian di dunia yang bisa dijadikan rujukan oleh organisasi Polri dalam melaksanakan kegiatan sehari-hari.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nSebagaiÂ <em>Center of Excellence</em>Â PTIK juga harus mampu melakukan berbagai riset mutakhir mengenai kepolisian di Indonesia untuk dijadikan acuan atau referensi bagi organisasi Polri secara keseluruhan. Riset adalah ujung tombak pengembangan keilmuan. Tanpa riset di bidang kepolisian, maka pengembangan ilmu kepolisian pasti akan mengalami kemandekan. Intinya, ini adalah gudang ilmu bagi Polri.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nMelalui pra penelitian, studi banding ke beberapa perguruan tinggi di Indonesia (Universitas Indonesia, Institut Teknologi Bandung, Institut Pemerintahan Dalam Negeri, dan Universitas Airlangga), serta Focus Group Discussion (FGD) dengan tokoh kepolisian dan para pakar, disepakatiÂ <em>centre of excellence</em>Â PTIK adalah di bidang :\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n1.Â Â Â  Â Â Pusat Studi Ilmu Kepolisian dengan konsentrasi awal pada Ilmu Administrasi Kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n2.Â Â Â  Â Â Pusat Riset dan Pengembangan Kepolisian dengan konsentrasi awal pada studi Pemolisian Demokratis (<em>Democratic Policing</em>) danÂ <em>scientific investigation</em>.\r\n</p>\r\n<p style="margin: 0px 0px 20px 42.55pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\n3.Â Â Â  Â Â Pusat Studi Ilmu Kepolisian Terapan dengan konsentrasi awal pada Manajemen Pengamanan (<em>Security Management</em>), Ilmu Forensik Kepolisian dan Viktimologi.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nPTIK sebagai sebuah lembaga pendidikan bertugas untuk mendidik para perwira Polri agar mempunyai pengetahuan tentang ilmu kepolisian dengan kualifikasi sebagai sarjana ilmu kepolisian. Karena itu semua lulusan PTIK diharapkan mampu mengembangkan teori-teori atau kajian-kajian yang bermanfaat bagi institusi kepolisian melalui kegiatan penelitian pengajarnya dalam bidang ilmu kepolisian.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nDengan dipilihnya tiga bidang tersebut, maka menjadi hal yang sangat penting untuk mewujudkan PTIK sebagai sebagaiÂ <em>Center of Excellent</em>Â yang menghasilkan produk yang bermutu dan berkualitas tinggi serta menjadi acuan bagi kalangan perguruan tinggi maupun kalangan masyarakat lainnya dalam bidang ilmu kepolisian. Dalam era globalisasi, informasi, dan interdependensi sebagaimana yang telah, sedang, dan akan berlangsung, peran perguruan tinggi menjadi semakin penting. PTIK sebagai perguruan tinggi kedinasan yang memberikan bekal kemampuan ilmiah bagi para pengemban profesi polisi harus mampu mengantarkan para mahasiswanya untuk bisa terlibat dan mampu mengambil peran dalam setiap proses perubahan yang akan terus selalu terjadi.\r\n</p>\r\n<p style="margin: 0px 0px 20px 21.3pt; padding: 0px; line-height: 1.83em; font-family: Tahoma, Arial, helvetica, sans-serif; font-size: small; text-align: justify">\r\nSelain itu sebagai sebuah perguruan tinggi yang mengkhususkan mendidik sarjana ilmu kepolisian, maka sudah sepatutnya PTIK juga menjadiÂ <em>centre of excellent</em>dengan keunggulan kompetitif yang berkelanjutan agar bisa menjadi akses bagi siapa saja membutuhkan rujukan, acuan, dan informasi tentang berbagai hal yang berkaitan dengan aktivitas kepolisian.\r\n</p>\r\n', '2015-10-05', '', 'bhinaya', 4685, '01:18:12', 'Senin'),
(35, 'Road Map menu', 'road-map-menu', 'tes&nbsp;Road Map menu\r\n', '2015-10-05', '', 'bhinaya', 0, '01:11:24', 'Senin'),
(36, 'Statuta menu', 'statuta-menu', 'tes&nbsp;Statuta menu\r\n', '2015-10-05', '', 'bhinaya', 277, '01:12:00', 'Senin'),
(38, 'Program S1 menu', 'program-s1-menu', 'tesÂ Program S1 menu\r\n', '2015-10-05', '', 'bhinaya', 291, '01:20:17', 'Senin'),
(39, 'Program S2 menu', 'program-s2-menu', 'tes Â Program S2 menu\r\n', '2015-10-05', '', 'bhinaya', 261, '01:20:42', 'Senin'),
(40, 'Kurikulum menu', 'kurikulum-menu', 'tesÂ Kurikulum menu\r\n', '2015-10-05', '', 'bhinaya', 243, '01:21:08', 'Senin'),
(41, 'Kerjasama Menu', 'kerjasama-menu', 'tes&nbsp;Kerjasama Menu\r\n', '2015-10-05', '', 'bhinaya', 203, '01:21:30', 'Senin');
INSERT INTO `halamanstatis` (`id_halaman`, `judul`, `judul_seo`, `isi_halaman`, `tgl_posting`, `gambar`, `username`, `dibaca`, `jam`, `hari`) VALUES
(50, 'Visi,  Misi dan Tujuan STIK PTIK', 'visi--misi-dan-tujuan-stik-ptik', '<!--[if gte mso 9]><xml>\r\n<o:OfficeDocumentSettings>\r\n<o:AllowPNG/>\r\n</o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n<p style="text-align: center" class="MsoNormal" align="center">\r\n<strong><span>SEKILAS TENTANG PERGURUAN TINGGI ILMU KEPOLISIAN</span></strong>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>PTIK dengan peran sebagai lembaga pendidikan kedinasan dan lembaga\r\npendidikan akademik, mempunyai jati diri sebagai Perguruan Tinggi Kedinasan\r\nKepolisian Republik Indonesia yang bertujuan mengembangkan Ilmu Kepolisian di\r\nIndonesia. Untuk mewujudkan hal tersebut, senantiasa dilakukan usaha-usaha\r\nmaksimal untuk meningkatkan kualitas proses belajar-mengajar (akademik) dan\r\nkualitas kelembagaan Sekolah Tinggi Ilmu Kepolisian &ldquo;PTIK&rdquo;, sehingga lembaga\r\nini mampu meluluskan perwira-perwira dengan kualitas terbaik untuk memenuhi\r\nkebutuhan masyarakat, bangsa, dan Negara Indonesia.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<strong><span><span>I.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span></strong><strong><span>LINTAS SEJARAH SINGKAT PTIK</span></strong>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Pada\r\ntanggal 18 Agustus 1945 di bentuk Badan Kepolisian Negara berdasarkanmaklumat\r\npemerintah, pada tanggal 29 September 1945 di lantik Kepala Kepolisian Negara\r\nyang pertama R.S. SoekantoPada tanggal17 Juli 1946 dengan Ketetapan Pemerintah\r\nNo. 11/SD/1946 dibentuk Jawatan Kepolisian Negara yang di pimpin oleh Kepala\r\nKepolisian Negara dan bertanggung jawab langsung kepada Perdana Menteri(Hari\r\nyang monumental ini selanjutnya di peringati sebagai hariBhayangkara). Semua\r\nFungsi Kepolisian disatukan dalam jawatan Kepolisian Negara yang memimpin\r\nKepolisian di seluruh tanah air.Pada tanggal 17 Juni 1946<span>&nbsp; </span>dibentuksekolah Kepolisian Negara pada bagian\r\ntinggi di Mertoyudan yang selanjutnya berproses dan berkembang menjadi Akademi\r\nPolisi dan berdasarkan Surat Keputusan Perdana Menteri Momor : 47/PM/II/50 tanggal\r\n1 September 1950 secara resmi nama Akademi Polisi diubah menjadi Perguruan\r\nTinggi Ilmu Kepolisian.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Penataan\r\nlembaga PTIK terus dilakukan danditingkatkan, dengan<span>&nbsp; </span>Surat Keputusan Perdana Menteri Nomor :\r\n87/PM/II/1954 tanggal 20 Agustus 1954 telah membagi pendidikan/pengajaran dalam\r\n2 (dua) bagian, meliputi : bagian &ldquo;persiapan&rdquo; PTIK atau Bakaloreat selama 3\r\ntahun dan bagian<span>&nbsp; </span>&ldquo;keahlian&rdquo; (doktoral)\r\nselama 2 (dua) tahun.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Perkembangan\r\nlebih lanjut kampus PTIK dari martoyudan di pindahkan keJogyakarta, beberapa\r\ntahun kemudian Kampus PTIK di pindahkan ke jalan Tambak no. 2 Jakarta.\r\nSelanjutnya pada tahun 1963<span>&nbsp; </span>Kampus PTIK\r\ndipindahkan ke Pasar Jum&rsquo;at dan menempati gedung Deplat 007 Ciputat, hingga\r\ntahun 1971 PTIK kemudian kampus PTIK berpindah lagi ke Jl.Tirtayasa No.6\r\nKebayoran Baru Jakarta Selatan hingga saat ini. Pada tahun 1976<span>&nbsp; </span>organisasi dan prosedur PTIK terjadi\r\nperubahan yang isinya bahwa Perguruan Tinggi Ilmu Kepolisian merupakan lembaga\r\npendidikan struktural berkedudukan dibawah dan tanggung jawab kepada Kapolri.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Berdasarkan\r\nSurat Keputusan Bersama Menteri Pendidikan dan Kebudayaan dan Kepala Kepolisian\r\nRepublik Indonesia Nomor 0214/O/1980 dan Nomor Kep/12/VII/80, PTIK merupakan\r\nPerguruan Tinggi Kedinasan dari Kepolisian Republik Indonesia. Tanggung jawab\r\natas pembinaan dan pengembangan aspek akademik dari pendidikan tinggi PTIK\r\ndilaksanakan oleh Menteri Pendidikan Nasional, sedangkan dari aspek pembinaan\r\nsumberdaya dibawah kendali Kapolri.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Perkembangan\r\norganisasi PTIK selanjutnya diatur berdasarkan Surat Keputusan Kapolri No. Pol\r\n: Kep/09/X/1984 tanggal 30 Oktober 1984 lampiran &ldquo;Z&rdquo; tentang pokok-pokok\r\norganisasi Prosedur bahwa PTIK merupakan badan penyelenggara dan pelaksana\r\npendidikan dan pengembangan ilmu dan teknologi Kepolisian bagi para perwira\r\nPolri yang berkedudukan di bawah Kapolri. Penyelenggaraan pendidikan tinggi\r\nbidang ilmu dan teknologi Kepolisian, baik untuk jalur gelar maupun non gelar,\r\nyang meliputi :</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Pendidikan dan pengajaran termasuk pembinaan mental kepribadian dan\r\nkesamaptaan;</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>b.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Penelitian dan pengembangan;</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>c.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Pengabdian masyarakat.</span>\r\n</p>\r\n<p style="text-align: justify; text-indent: 21.3pt" class="MsoNormal">\r\n<span>Berdasarkan Surat Keputusan\r\nKepala Kepolisian Republik Indonesia Nomor Pol: Skep/2002/XII/1994, tentang\r\nStatuta PTIK, bahwa PTIK ditetapkan menjadi Sekolah Tinggi Ilmu Kepolisian.\r\nPengembangan lebih lanjut terhadap PTIK, telah dilakukan Restrukturisasi\r\norganisasi Sekolah Tinggi Ilmu Kepolisian &ldquo;PTIK&rdquo; selaras dengan struktur\r\norganisasi Perguruan Tinggi Negeri/Swasta. STIK-PTIK telah dan sedang\r\nmenyelenggarakan program pendidikan disamping Strata satu (S1) Ilmu Kepolisian\r\njuga melaksanakan program studi sebagai berikut :</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Berdasarkan surat Keputusan Kapolri no pol : Skep/1183/VIII/1994 tanggal 29\r\nAgustus 1994 diselenggarakan pendidikan D-3 Ilmu Kepolisian khusus untuk Polisi\r\nwanita di lingkungan Polri.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>b.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Keputusan Mendiknas Nomor : 84/D/O/2010 tanggal 14 Juni 2010, selanjutnya\r\ndikuatkan dengan Surat Keputusan Kapolri nomor : Kep/378/VI/2010 tanggal 18\r\nJuni 2010 tentang penyelenggaraan Program Pasca Sarjana (S2) Ilmu Kepolisian\r\nSTIK-PTIK.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt" class="MsoNormal">\r\n<strong><span><span><span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;\r\n</span>II.</span></span></strong><strong><span>VISI, MISI DAN TUJUAN PTIK</span></strong>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify; text-indent: -14.7pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>VISI PTIK</span>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify" class="MsoNormal">\r\n<span>Visi Sekolah Tinggi Ilmu Kepolisian PTIK adalah\r\nmenjadi pendidikan tinggi yang dapat dibanggakan dan dapat diandalkan dalam\r\nmewujudkan Perwira Sarjana Ilmu Kepolisian yang Profesional dan bermoral serta\r\nmenjadi Pusat Pengkajian permasalahan kepolisian dan Pengembangan Ilmu dan\r\nTeknologi Kepolisian. Menjadi Perguruan tinggi kepolisian yang modern bertaraf\r\ninternasional dengan kompetensi utama administrasi kepolisian, berkarakter\r\nkemandirian dan penggerak perubahan.</span>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify; text-indent: -14.7pt" class="MsoNormal">\r\n<span>b.<span>&nbsp;&nbsp; </span>MISI PTIK</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>1.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyelenggarakan Pendidikan Tinggi Ilmu Kepolisian yang bermutu tinggi dan\r\nmemiliki keunggulan serta daya saing dalam pemantapan pembangunan dan\r\npemeliharaan keamanan.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>2.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp; </span></span></span><span>Mengembangkan ilmu dan teknologi kepolisian sesuai tuntutan kebutuhan\r\nmasyarakat pada masa kini dan masa mendatang.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>3.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp; </span></span></span><span>Menyelenggarakan pengkajian terhadap masalah-masalah pemolisian dan\r\nmemberikan rekomendasi akademis dalam rangka perumusan kebijakan.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>4.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyelenggarakan pengabdian kepada masyarakat dalam rangka penerapan Ilmu\r\ndan Teknologi Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>5.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp; </span></span></span><span>Mempromosikan penyelenggaraan Pendidikan dan Pengembangan Ilmu dan\r\nTeknologi Kepolisian pada perguruan tinggi, serta menyiapkan tenaga-tenaga\r\npendidik Ilmu Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>6.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyelenggarakan kerjasama dengan lembaga Pendidikaan Tinggi dan\r\nLembaga-lembaga lain dalam skala Nasional maupun Internasional.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>7.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp; &nbsp; &nbsp;\r\n</span></span></span><span>Menyelenggarakan pembinaan\r\nkemahasiswaan yang komprehensif dan kompetitif.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>8.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyelenggarakan pendidikan dan pelatihan lainnya secara profesional.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt" class="MsoNormal">\r\n<span>c.<span>&nbsp;&nbsp; </span>TUJUAN PTIK</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>1.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Tujuan Umum</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify" class="MsoNormal">\r\n<span>Meningkatkan kemampuan anggota Polri dan hasil\r\ndidik lainnya yang berwawasan ilmiah, bermoral dan mampu melaksanakan tugas\r\nsecara profesional di bidang Pemeliharaan Keamanan dan Ketertiban Masyarakat,\r\nPenegakan Hukum serta Perlindungan, Pengayoman dan Pelayanan kepada masyarakat.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -18pt" class="MsoNormal">\r\n<span>2.<span>&nbsp;&nbsp;&nbsp; </span>Tujuan Khusus</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>a)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Meningkatkan kemampuan para perwira Polri lulusan Akademi Kepolisian yang\r\nberkualifikasi sarjana, memiliki wawasan ilmiah, bermoral dan<span>&nbsp; </span>profesional sebagai praktisi dan asisten\r\nmanajer tingkat menengah dalam melaksanakan tugas kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>b)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp; </span></span></span><span>Meningkatkan kemampuan anggota Polri, yang memiliki wawasan ilmiah,\r\nbermoral dan<span>&nbsp; </span>profesional sebagai\r\npraktisi dalam pelaksanaan fungsi kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>c)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Mewujudkan sumber daya manusia yang berkualifikasi Sarjana Ilmu Kepolisian\r\nyang cerdas, berbudaya, bermoral tinggi, kreatif dan inovatif yang mampu\r\nmemahami, menerapkan dan mengembangkan ilmu dan teknologi kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>d)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Mewujudkan sumber daya perwira Polri yang berwawasan ilmiah, berkualifikasi\r\nsarjana, bermoral dan profesional, sebagai praktisi dan asisten manajer tingkat\r\nmenengah dalam melaksanakan fungsi kepolisian.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -14.2pt" class="MsoNormal">\r\n<strong><span>III.<span> </span>KEGIATAN PENDIDIKAN DAN PENGEMBANGAN ILMU\r\nKEPOLISIAN</span></strong>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify; text-indent: -18pt" class="MsoNormal">\r\n<span><span>1.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Pendidikan Program Sarjana\r\n(S1) Ilmu Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Program studi Strata Satu (S1) Ilmu Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>1)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Menyelenggarakan Pendidikan Program Jarak Jauh (PPJJ) out kampus selama 5\r\n(lima) Bulan.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>2)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></span><span>Pendidikan on kampus selama 11\r\n(sebelas) Bulan.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>3)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp; </span></span></span><span>Untuk program pendidikan T.A. 2010-2011 dan seterusnya tidak lagi\r\nmenyelenggarakan PPJJ akan tetapi seluruh kegiatan dilaksanakan on kampus\r\nselama 4 semester (18 Bulan).</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>4)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp; </span></span></span><span>Untuk T.A. 2011-2012 jumlah mahasiswa PTIK per angkatan sebanya 150\r\nmahasiswa.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span>b.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Program studi Pasca Sarjana (S2) Ilmu\r\nKepolisian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>1)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp; </span></span></span><span>Saat ini sedang dalam proses persiapan kurikulum, sarana dan fasilitas\r\npendidikan dosen matakuliah, tenaga kependidikan, dan komponen pendidikan\r\nlainnya.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>2)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Susun rencana kegiatan sosialisasi penyelenggaraan Program Pasca Sarjana\r\n(S2) Ilmu Kepolisian dengan target Internasional dan Eksternal.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>3)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Menjalin kerjasama dengan PTN/PTS dan pihak terkait.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify; text-indent: -18pt" class="MsoNormal">\r\n<span>2.<span>&nbsp;&nbsp;&nbsp; </span>Penelitian dan Pengembangan Ilmu dan\r\nTeknologi Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyusun rencana kegiatan penelitian dan pengembangan.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>b.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Menyelenggarakan kegiatan penelitian, untuk T.A. 2010 telah ditetapkan 8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\nprogram penelitian dengan anggaran DIPA PTIK dan 2 program swadaya.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>c.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Menerbitkan hasil penelitian dalam bentuk :</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>1)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>PTIK Press</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>2)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Jurnal Ilmu Kepolisian STIK-PTIK.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>3)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Laporan hasil penelitian.</span>\r\n</p>\r\n<p style="margin-left: 78pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>4)<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Buku Reformasi, disebar luaskan kepada masyarakat.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span>d.<span>&nbsp; </span>Menyelenggarakan seminar sekolah, seminar\r\nNasional dan berbagai kegiatan pertemuan ilmiah.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span>e.<span>&nbsp;&nbsp; </span>Melakukan kerjasama dengan berbagai pihak\r\ndalam pengembangan pendidikan dan pengkajian Ilmu dan Teknologi Kepolisian.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 36pt; text-align: justify; text-indent: -18pt" class="MsoNormal">\r\n<span>3.<span>&nbsp;&nbsp;&nbsp; </span>Pengabdian Masyarakat.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>a.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Merencanakan kegiatan pengabdian masyarakat.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>b.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Melaksanakan dan mengendalikan kegiatan pengabdian masyarakat dalam rangka\r\npenerapan dan pemanfaatan Ilmu Kepolisian sebagai bagian dari Tri Dharma\r\nPerguruan Tinggi.</span>\r\n</p>\r\n<p style="margin-left: 2cm; text-align: justify; text-indent: -21.25pt" class="MsoNormal">\r\n<span><span>c.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span>Melakukan kerja sama dengan pihak-pihak terkait.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>&nbsp;</span>\r\n</p>\r\n<p style="margin-left: 9.4pt; text-align: justify; text-indent: -9.4pt" class="MsoNormal">\r\n<strong><span>IV.<span>&nbsp;&nbsp;&nbsp; </span>PENGEMBANGAN PTIK KE DEPAN MENUJU CENTER OF\r\nEXCELLENCE</span></strong>\r\n</p>\r\n<p style="text-align: justify; text-indent: 21.3pt" class="MsoNormal">\r\n<span>Keunggulan suatu perguruan\r\ntinggi terutama terletak pada keunggulan sivitas akademikanya beserta\r\npengorganisasiannya. Walaupun kepakaran melekat pada perorangan, namun\r\npengorganisasian dirinya dapat melahirkan pakar-pakar baru dalam bidangnya yang\r\nlebih mutakhir dalam keilmuannya. Bahkan terdapat kemungkinan kepakaran baru\r\nsebagai hasil pengembangan kepakaran yang telah ada. Kelahiran, pertumbuhan,\r\npencapaian kedewasaan dan kematian adalah hal alamiah yang akan dialami oleh\r\nseseorang maupun lembaga. Namun demikian, kepakaran tidak akan mati apabila\r\ndalam menuju kedewasaannya, tumbuh tunas-tunas baru dengan berbagai kelebihan\r\ndan kekurangannya, yang akan menjadi penerus dan pengembang kepakaran. Demikian\r\npula suatu lembaga, pencapaian kedewasaan dan kemampuan adalah tanda harus\r\nadanya pembaharuan.</span>\r\n</p>\r\n<p style="text-align: justify; text-indent: 21.3pt" class="MsoNormal">\r\n<span>Banyak pendapat pakar\r\npendidikan yang mengidealisasikan pendidikan tinggi sebagai pusat keunggulan,\r\natau Center of Excellence. Dalam hal ini mungkin kita bisa mencari padanan\r\nkisahnya di dunia olahraga. Konon, seorang pelatih bulutangkis bertanya secara\r\noratoris kepada anak asuhnya: mengapa bulutangkis Jerman yang didukung oleh\r\nlitbang dan aplikasi teknologi mutakhir toh tak bisa terangkat prestasinya di\r\ntingkat dunia, sementara bulutangkis di Indonesia yang didukung oleh dana\r\nterbatas dan doa syafaat rakyatnya, justru berhasil merambah dunia selama\r\npuluhan tahun? Sebaliknya, mengapa Indonesia yang berpenduduk lebih dari 200\r\njuta orang ini sulit mencari 11 pemain sepakbola, sementara Jerman yang\r\nberpenduduk hanya puluhan juta bisa melahirkan ratusan pesepakbola yang\r\nberkualitas dunia?</span>\r\n</p>\r\n<p style="text-align: justify; text-indent: 21.3pt" class="MsoNormal">\r\n<span>Secara dogmatis-hipotetis\r\nlontaran pertanyaan itu dijawab sendiri oleh sang pelatih: tulang bangsa Jerman\r\ncocok untuk sepakbola, tidak untuk bulutangkis. Sementara tulang bangsa\r\nIndonesia cocok untuk bulutangkis, tidak untuk sepakbola! Sebagai dogma,\r\nkebenaran di atas mungkin terpaksa harus kita terima, karena memang\r\nkenyataannya demikian. Demikian pula sebagai hipotesa, jawaban tersebut\r\ndianggap benar walaupun masih perlu dibuktikan secara empiris. Oleh karena itu,\r\ndipandang tepat jika kita selalu mengkaji faktor-faktor keunggulan yang sesuai\r\ndengan &lsquo;tulang&rsquo; dunia pendidikan kita, guna pemantapan eksistensinya sebagai\r\ncenter of excellence.</span>\r\n</p>\r\n<p style="text-align: justify; text-indent: 21.3pt" class="MsoNormal">\r\n<span>Dengan merujuk pada\r\npemahaman tersebut, maka PTIK sebagai lembaga pendidikan kedinasan Polri untuk\r\nbisa menuju pada posisi sebagai centre of excellence harus melewati berbagai\r\nupaya persiapan pada suatu masa transisi. Persiapan tersebut terdiri atas berbagai\r\nkegiatan yang meliputi:</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>1.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp; </span></span></span><span>Penentuan baseline PTIK melalui Evaluasi Pelaksanaan Pendidikan di PTIK\r\nyang<span>&nbsp; </span>menyangkut penyelenggaraan kegiatan\r\nTri Dharma Perguruan Tinggi dan kebutuhan organisasi dalam hal ini Polri.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>2.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Perumusan kompetensi strategis PTIK dan strategi PTIK dalam berperanserta\r\nmembangun bangsa dalam hal ini terkait dengan Grand Strategy Polri.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>3.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Penyiapan New Capacity Building melalui Peningkatan Keberdayaan Keilmuan,\r\nKepakaran dan Kelembagaan berbasis sinergi dalam jaringan kerjasama.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>4.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp; </span></span></span><span>Pengembangan Sistem dan Standar Proses Pembelajaran, R-D&amp;E,\r\nPemberdayaan Masyarakat, Karier dan Remunerasi yang meliputi metodologi dan\r\nmanajemennya, melalui pemodelan dan penelitian yang berkaitan dengan kegiatan\r\nkepolisian.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>5.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Peningkatan keberdayaan sivitas akademika dan sarana akademik (untuk\r\nmenentukan Driving Force);</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Oleh karena itu Center of Excellence (pusat keunggulan) haruslah memiliki\r\nstandar kinerja (Key Performance Indicator atau KPI) yang unggul. Semua sasaran\r\nkerja dibuat setinggi mungkin, dan tidak ada toleransi. Misalnya, nilai dalam\r\nproses pendidikan dibuat dengan standar tinggi, tidak ada katrol nilai alias\r\ntoleransi. Prinsipnya adalah, untuk mencapai keunggulan, dibutuhkan standar\r\nyang tinggi, dan tidak ada toleransi mengenai hal ini. Sebagai Center of\r\nExcellence (pusat keunggulan), PTIK juga harus mampu membuat standar yang\r\ntinggi untuk proses pendidikan personel Polri, tanpa ada toleransi. sehingga\r\nhasil yang betul-betul personel atau SDM Polri yang berkualitas tinggi.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Dari berbagai literatur, dapat disimpulkan bahwa ada 6 (enam) ciri khas\r\ndari sebuah Center of Excellence (pusat keunggulan), yaitu:</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Membentuk kader personel atau SDM yang unggul.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>2.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Menjadi pusat rujukan atau\r\nacuan jika ada masalah di organisasi.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>3.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Memiliki standar kinerja\r\n(key performance indicator /KPI) yang unggul.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>4.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Memiliki proses kerja yang\r\nunggul.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>5.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Dijalankan oleh personel\r\natau SDM yang unggul.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>6.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Memiliki budaya organisasi\r\nyang unggul.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Dalam kaitan dengan posisi PTIK, maka sebagai Center of Excellence (pusat\r\nkeunggulan) harus mampu menjadi pusat rujukan atau acuan jika ada masalah yang\r\nada di dalam organisasi. Ini berarti, Center of Excellence (pusat keunggulan)\r\nharus memiliki banyak perpustakaan atau pengetahuan yang bisa dijadikan referensi\r\natau acuan dalam menjalankan organisasi, termasuk mengadakan berbagai\r\nriset-riset yang mutakhir sesuai dengan bidangnya. Khusus untuk Polri, maka\r\nPTIK sebagai Center of Excellence) harus memiliki banyak buku, jurnal, tulisan,\r\natau pun berbagai sumber referensi lainnya mengenai berbagai praktek kepolisian\r\ndi dunia yang bisa dijadikan rujukan oleh organisasi Polri dalam melaksanakan\r\nkegiatan sehari-hari.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Sebagai Center of Excellence PTIK juga harus mampu melakukan berbagai riset\r\nmutakhir mengenai kepolisian di Indonesia untuk dijadikan acuan atau referensi\r\nbagi organisasi Polri secara keseluruhan. Riset adalah ujung tombak\r\npengembangan keilmuan. Tanpa riset di bidang kepolisian, maka pengembangan ilmu\r\nkepolisian pasti akan mengalami kemandekan. Intinya, ini adalah gudang ilmu\r\nbagi Polri.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Melalui pra penelitian, studi banding ke beberapa perguruan tinggi di\r\nIndonesia (Universitas Indonesia, Institut Teknologi Bandung, Institut\r\nPemerintahan Dalam Negeri, dan Universitas Airlangga), serta Focus Group Discussion\r\n(FGD) dengan tokoh kepolisian dan para pakar, disepakati centre of excellence\r\nPTIK adalah di bidang :</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>1.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Pusat Studi Ilmu Kepolisian dengan konsentrasi awal pada Ilmu Administrasi\r\nKepolisian.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>2.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Pusat Riset dan Pengembangan Kepolisian dengan konsentrasi awal pada studi\r\nPemolisian Demokratis (Democratic Policing) dan scientific investigation.</span>\r\n</p>\r\n<p style="margin-left: 21.3pt; text-align: justify; text-indent: -21.3pt" class="MsoNormal">\r\n<span><span>3.<span style="font: 7pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp; </span></span></span><span>Pusat Studi Ilmu Kepolisian Terapan dengan konsentrasi awal pada Manajemen&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\nPengamanan (Security Management), Ilmu Forensik Kepolisian dan Viktimologi.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>PTIK sebagai sebuah lembaga pendidikan bertugas untuk mendidik para perwira\r\nPolri agar mempunyai pengetahuan tentang ilmu kepolisian dengan kualifikasi\r\nsebagai sarjana ilmu kepolisian. Karena itu semua lulusan PTIK diharapkan mampu\r\nmengembangkan teori-teori atau kajian-kajian yang bermanfaat bagi institusi\r\nkepolisian melalui kegiatan penelitian pengajarnya dalam bidang ilmu\r\nkepolisian.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Dengan dipilihnya tiga bidang tersebut, maka menjadi hal yang sangat\r\npenting untuk mewujudkan PTIK sebagai sebagai Center of Excellent yang\r\nmenghasilkan produk yang bermutu dan berkualitas tinggi serta menjadi acuan\r\nbagi kalangan perguruan tinggi maupun kalangan masyarakat lainnya dalam bidang\r\nilmu kepolisian. Dalam era globalisasi, informasi, dan interdependensi\r\nsebagaimana yang telah, sedang, dan akan berlangsung, peran perguruan tinggi\r\nmenjadi semakin penting. PTIK sebagai perguruan tinggi kedinasan yang\r\nmemberikan bekal kemampuan ilmiah bagi para pengemban profesi polisi harus\r\nmampu mengantarkan para mahasiswanya untuk bisa terlibat dan mampu mengambil\r\nperan dalam setiap proses perubahan yang akan terus selalu terjadi.</span>\r\n</p>\r\n<p style="text-align: justify" class="MsoNormal">\r\n<span>Selain itu sebagai sebuah perguruan tinggi yang mengkhususkan mendidik\r\nsarjana ilmu kepolisian, maka sudah sepatutnya PTIK juga menjadi centre of\r\nexcellent dengan keunggulan kompetitif yang berkelanjutan agar bisa menjadi\r\nakses bagi siapa saja membutuhkan rujukan, acuan, dan informasi tentang\r\nberbagai hal yang berkaitan dengan aktivitas kepolisian.</span>\r\n</p>\r\n', '2015-12-12', '', 'admin', 2148, '16:57:30', 'Sabtu'),
