(54, 'ILMU KEPOLISIAN SUATU BIBLIOGRAFI', 'ilmu-kepolisian-suatu-bibliografi', '<font face="tahoma, arial, helvetica, sans-serif"><font size="1">\r\n</font>\r\n<p style="text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="1"><strong style="font-weight: normal"><br />\r\n</strong>\r\n</font>\r\n</p>\r\n<p style="text-align: center; line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<span style="font-family: Calibri; color: #000000; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent"><font size="3">ILMU&nbsp;KEPOLISIAN&nbsp;SUATU&nbsp;BIBLIOGRAFI</font></span>\r\n</p>\r\n<p style="text-align: center; line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="1"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">(Harsya&nbsp;W.&nbsp;Bachtiar,1993)</span>\r\n</font>\r\n</p>\r\n<p style="text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="1"><strong style="font-weight: normal"><br />\r\n</strong>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #ff0000; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">01.</span><span style="font-family: Calibri; color: #000000; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;</span><span style="font-family: Calibri; color: #ff0000; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">Kepolisian</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt; text-indent: 28.3pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">Meskipun&nbsp;fungsi&nbsp;utama&nbsp;kepolisian&nbsp;di&nbsp;negara&nbsp;mana&nbsp;saja&nbsp;pada&nbsp;umumnya&nbsp;sama,&nbsp;apa&nbsp;yang</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">sesungguhnya&nbsp;ditanggapi&nbsp;sebagai&nbsp;urusan&nbsp;kepolisian&nbsp;bisa&nbsp;berbeda-beda&nbsp;sehingga&nbsp;struktur&nbsp;organisasi&nbsp;satuan</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">kepolisian&nbsp;di&nbsp;sekalian&nbsp;negara&nbsp;juga&nbsp;memperlihatkan&nbsp;persamaan&nbsp;maupun&nbsp;perbedaan-perbedaan&nbsp;yang&nbsp;cukup</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none;