e="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">MANNING,&nbsp;Peter&nbsp;Kirby,&nbsp;1940-,</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;Police&nbsp;Work:&nbsp;the&nbsp;social&nbsp;organization&nbsp;of&nbsp;policing</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">.&nbsp;Cambridge,&nbsp;MA:&nbsp;MIT&nbsp;Press,</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.45pt; text-indent: 56.65pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">1977.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.45pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">MANNING,&nbsp;Peter&nbsp;Kirby,&nbsp;1940-&nbsp;;&nbsp;dan&nbsp;John&nbsp;van&nbsp;MAANEN,&nbsp;ed.,</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;Policing:&nbsp;a&nbsp;view&nbsp;from&nbsp;the&nbsp;street</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">.&nbsp;-New&nbsp;York:</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.45pt; text-indent: 56.65pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">Random&nbsp;House,&nbsp;1979.&nbsp;360&nbsp;hlm.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.45pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">MARK,&nbsp;Sir&nbsp;Robert,&nbsp;1917-,</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;Policing&nbsp;a&nbsp;Perplexed&nbsp;Society</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;.London:&nbsp;Alien&nbsp;&amp;&nbsp;Unwin,&nbsp;1977.&nbsp;132&nbsp;hlm.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.45pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">PIKE,&nbsp;Michael&nbsp;S.,</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;The&nbsp;Principles&nbsp;of&nbsp;Policing</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">.&nbsp;London:&nbsp;Macmillan&nbsp;Publishers,&nbsp;1985.&nbsp;224&nbsp;hlm.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">POPE,&nbsp;David&nbsp;W.;&nbsp;dan&nbsp;Norman&nbsp;L.&nbsp;WEINER,&nbsp;Modem&nbsp;Policing&nbsp;London:&nbsp;Croom&nbsp;Helm,&nbsp;1981.&nbsp;vi&nbsp;+&nbsp;271&nbsp;hlm.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">SHEARING,&nbsp;Clifford&nbsp;D.;&nbsp;dan&nbsp;Philip&nbsp;C.&nbsp;STENNING,&nbsp;ed.,</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">&nbsp;Private&nbsp;Policing</span><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">.&nbsp;Beverly&nbsp;Hills,&nbsp;CA:&nbsp;Sage&nbsp;Publications,</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt; text-indent: 56.65pt" dir="ltr">\r\n<font size="2"><span style="font-family: Calibri; color: #000000; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">1987.&nbsp;320&nbsp;hlm.</span>\r\n</font>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.4pt" dir="ltr">\r\n<font size="2">\r\n&nbsp;\r\n</font>\r\n</p>\r\n</font>\r\n', '2016-02-11', '', 'bhinaya', 1044, '19:30:24', 'Kamis');
