(47, 'ORGANISASI dan TATA KERJA STIK', 'organisasi-dan-tata-kerja-stik', '<blockquote style="margin: 0px 0px 0px 40px; border: none; padding: 0px">\r\n	<div style="text-align: justify">\r\n	<font size="2">STIK merupakan unsur pelaksana utama yang berada di bawah Lemdikpol;</font>\r\n	</div>\r\n	<div style="text-align: justify">\r\n	<font size="2">STIK dipimpin oleh Ketua STIK yang bertanggung jawab kepada Kalemdikpol;</font>\r\n	</div>\r\n	<div style="text-align: justify">\r\n	<font size="2">STIK bertugas menyelenggarakan fungsi pendidikan tinggi bidang ilmu kepolisian bagi kepentingan Polri dan unsur-unsur terkait serta pengkajian dan penelitian masalah-masalah yang berkaitan dengan fungsi kepolisian dalam rangka pengembangan dan mendorong penerapan ilmu dan teknologi kepolisian;</font>\r\n	</div>\r\n	<div style="text-align: justify">\r\n	<font size="2">dalam melaksanakan tugas, STIK menyelenggarakan fungsi:</font>\r\n	</div>\r\n</blockquote>\r\n<div style="text-align: justify">\r\n<br />\r\n</div>\r\n', '2015-12-04', '', 'bhinaya', 2106, '15:22:37', 'Jumat'),
(48, 'KONTAK KAMI', 'kontak-kami', '<div>\r\nTelp: +62(021) 7222234\r\n</div>\r\n<div>\r\nJl. Tirtayasa Raya 6 Kebayoran Baru, Jakarta Selatan. Indonesia\r\n</div>\r\n<div style="text-align: left">\r\n<a rel="lightbox" rev="alternate" href="/">admin@stik-ptik.ac.id</a> \r\n</div>\r\n', '2015-12-05', '', 'bhinaya', 204, '02:56:16', 'Sabtu'),
(51, 'Program S2 Kajian Ilmu Kepolisian', 'program-s2-kajian-ilmu-kepolisian', '<h3 style="font-size: inherit; margin: 0px 0px 0.5em; color: #1b1b1b; line-height: 12px; border: 0px; padding: 0px; outline: 0px; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial"><strong>PROGRAM PASCASARJANA KAJIAN ILMU KEPOLISIAN</strong></h3>\r\n<h3 style="text-align: center; margin: 0px 0px 0.5em; color: #1b1b1b; line-height: 12px; border: 0px; padding: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial">\r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: justify">\r\n<strong>TUJUAN PENDIDIKAN</strong><br />\r\nProgram ini bertujuan untuk memberikan pendidikan lanjutan kepada sejumlah lulusan Program Sarjana (S1) di Indonesia yang menunjukkan kemampuan kuat untuk kemudian mengembangkan keahliannya dalam berbagai bidang ilmu kepolisian. Melalui integritas dari sejumlah perkuliahan, seminar, lokakarya, penelitian individual dan penulisan tesis, para peserta dapat memperdalam pengetahuan mereka tentang prinsip-prinsip ilmu kepolisian dan memperoleh spesialisasi (kekhususan) yang mereka inginkan. Secara singkat tujuan umum ini dapat<br />\r\ndiuraikan sebagai berikut:<br />\r\n1. Mendidik dan menghasilkan Magister dan Doktor llmu Kepolisian yang mampu secara interdisiplin terhadap berbagai aspek kepolisian.<br />\r\n2. Mendidik dan mengha silkan Magister dan Doktor llmu Kepolisian (MSi) yang mampu secara interdisiplin membuat perencanaan pelaksanaan dan pemecahan berbagai masalah kepolisian.<br />\r\n3. Mendidik dan menghasilkan Magister dan Doktor llmu Kepolisian (MSi) yang akan menjadi pengajar ahli ilmu kepolisian dan sekaligus calon peneliti dalam mengembangkan ilmu kepolisian.\r\n</p>\r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: start">\r\n<strong>RENCANA KURIKULUM S2 STIK</strong><br />\r\n<strong>Semester I</strong><br />\r\n1. Filsafat Ilmu (2 SKS)<br />\r\n2. Perkembangan Teori Administreasi dan Manajemen (2 SKS)<br />\r\n3. Perkembangan Sistem Kepolisian (2 SKS)<br />\r\n4. Perkembangan dan Pencegahan Kejahatan (2 SKS)<br />\r\n5. Perkembangan Teknologi Kepolisian (2 SKS)<br />\r\n6. Teori Komunikasi dan Perspektif (2 SKS)<br />\r\n7. Pembaharuan Hukum Pidana (2 SKS)<br />\r\n8. Manajemen Sumber Daya Kepolisian (2 SKS)\r\n</p>\r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: start">\r\n<strong>Semester II</strong><br />\r\n1. Teori Kriminologi Kontemporer (2 SKS)<br />\r\n2. Metodologi Kepolisian (2 SKS)<br />\r\n3. Transnational Organized Crime (Termasuk Kejahatan Korporasi) (2 SKS)<br />\r\n4. Perkembangan Sosial dan Kepolisian (2 SKS)<br />\r\n5. Studi Keamanan (Termasuk Public And Human Security) (2 SKS)<br />\r\n6. HAM dan Demokrasi (2 SKS)<br />\r\n7. Manajemen Strategik (2 SKS)<br />\r\n8. Kebijakan Publik dan Kepolisian (2 SKS)<br />\r\n9. Teori Organisasi (2 SKS)<br />\r\n10. Manajemen Resiko (2 SKS)\r\n</p>\r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: start">\r\n<strong>Semester III</strong><br />\r\n1. Manajemen Harkam (Konfl ik Sosial dan Perkembangannya) (2 SKS)<br />\r\n2. Manajemen Transportasi (2 SKS)<br />\r\n3. Hukum Pidana dan Kegiatan Perekonomian<br />\r\n(2 SKS)<br />\r\n4. Hukum Pidana Kontemporer (2 SKS)<br />\r\n5. Ujian Proposal Penelitian (5 SKS)<br />\r\n6. Kursus Singkat\r\n</p>\r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: start">\r\n<strong>Semester IV</strong><br />\r\n1. Tesis (10 SKS)\r\n</p>\r\n<a href="http://www.pascasarjana-stik-ptik.com">http://www.pascasarjana-stik-ptik.com</a> \r\n<p style="line-height: 18px; color: #555555; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: normal; text-align: start">\r\n&nbsp;&nbsp;\r\n</p>\r\n</h3>\r\n', '2015-12-12', '', 'admin', 6313, '17:10:26', 'Sabtu'),
(57, 'Contact Us', 'contact-us', '<ul style="margin: 0px; color: #333333; font-family: Arial, serif; font-size: 12px; line-height: 19px; padding-left: 24px !important">\r\n	<li class="telephone_no" style="margin: 0px; background-image: url(../images/tele.gif); background-attachment: initial !important; background-color: initial !important; background-size: initial !important; background-origin: initial !important; background-clip: initial !important; background-position-x: 0%; background-position-y: 5px !important; background-repeat: no-repeat !important">+62(021) 7222234</li>\r\n	<li class="mailing_address" style="margin: 0px; background-image: url(../images/mail.gif); background-attachment: initial !important; background-color: initial !important; background-size: initial !important; background-origin: initial !important; background-clip: initial !important; background-position-x: 0%; background-position-y: 2px !important; background-repeat: no-repeat !important">Jl. Tirtayasa Raya 6 Kebayoran Baru, Jakarta Selatan. Indonesia</li>\r\n	<li class="email_address" style="margin: 0px; background-image: url(../images/email.gif); background-attachment: initial !important; background-color: initial !important; background-size: initial !important; background-origin: initial !important; background-clip: initial !important; background-position-x: 0%; background-position-y: 0px !important; background-repeat: no-repeat !important"><a style="color: #00bbff; text-decoration: none; border: none; font-family: Geneva, Arial, Helvetica, sans-serif; outline: none" href="../hal-program-s2-kajian-ilmu-kepolisian.html">admin@stik-ptik.ac.id</a></li>\r\n</ul>\r\n', '2016-02-11', '23Slide3.JPG', 'bhinaya', 3957, '23:53:02', 'Kamis');
INSERT INTO `halamanstatis` (`id_halaman`, `judul`, `judul_seo`, `isi_halaman`, `tgl_posting`, `gambar`, `username`, `dibaca`, `jam`, `hari`) VALUES
(56, 'Berbagai Pandangan Tentang Ilmu Kepolisian', 'berbagai-pandangan-tentang-ilmu-kepolisian', '<div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span><strong><font color="#0000ff">Berbagai PandanganTentang Ilmu Kepolisian</font></strong>\r\n</div>\r\n<div style="text-align: justify">\r\n&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dalam perkembangannya, sejarah membuktikan tugas-tugas penyelenggaraan fungsi kepolisian mautidak mau harus mampu menjawab perkembangan lingkungan strategis dan harapan masyarakat. Karena fungsi kepolisian adalah fungsional dalam kehidupan manusia bermasyarakat dan bernegara. Fungsi kepolisian harus dilihat dalam perspektif bahwa individu, masyarakat dan negara, masing-masing merupakan sebuah sistem yang secara keseluruhan memproses masukan-masukan program pembangunan untuk menghasilkan keluaran berupa kemakmuran, keadilan, dan kesejahteraan. Dalam proses demikian, maka fungsi kepolisian bertugas untuk menjaga agar keluaran yang diharapkan sesuai dengan tujuan yang ingin dicapai dan menjaga agar individu, masyarakat dan negara yang merupakan unsur-unsur utama dalam roses tersebut tidak terganggu atau dirugikan. Sebab setiap gangguan hanya akan mengakibatkan tidak tercapainya hasil keluaran yang diharapkan.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Berikut ini akan dijelaskan beberapa pendapat, pandangan, dan pemahaman Ilmu Kepolisian dari para tokoh ilmuwan dan pemerhati kepolisian. Tentunya, pendapat tersebut sangat dipengaruhi oleh latar belakang keilmuan, keluasan pengalaman dan kedalaman pemahaman atas masalah-masalah yang berkaitan dengan kepolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n&nbsp;<span style="white-space: pre" class="Apple-tab-span">	</span>Diawali dari pendapat salah seorang pendiri dan sekaligus Dekan ke-3 Perguruan Tinggi Ilmu Kepolisian, Prof. Mr. Djokosoetono (1955-1965), bahwa Ilmu Kepolisian merupakan segenap ilmu pengetahuan (complex) yang dibutuhkan untuk menjalankan tugas Kepolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n&nbsp;<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Daoed Joesoef, Menteri Pendidikan dan Kebudayaan, disampaikan pada pelantikan Dekan dan Wisuda Sarjana PTIK Angkatan XV, tanggal 28 Agustus 1980. Kerja polisi pada umumnya adalah atau profesi kepolisian pada khususnya merupakan kerja dan profesi kemasyarakatan, oleh karena itu diperlukan adanya training ilmiah sebelumnya untuk kerja dan profesi ini. Ilmu Kepolisian sebagai disiplin ilmiah merupakan suatu proses yang berkelanjutan dan cara pendekatan dan berpikir interdisipliner untuk kerja kemasyarakatan. Cara berpikir interdisipliner membedakan dalam tiga tahapan. Pertama, yang disebut multidisiplinaritas yaitu beberapa pengetahuan yang berbeda, menggarap berbagai aspek yang berbeda dari masalah praktis yang sama. Kedua, krosdisiplinaritas, yaitu satu disiplin ilmiah mendominir ilmu lainnya yang turut membantu mengkaji masalah yang sama berhubung disiplin ilmiah yang satu itu diakui lebih mendekati inti permasalahan yang dihadapi. Ketiga, transdisiplinaritas, dimana semua disiplin ilmu sudah melebur diri menjadi satu pengertian ilmiah, jadi terjadi satu keterpaduan yang sama. Ilmu Kepolisian adalah ilmu yang mandiri, karena memiliki persyaratan esensial yang diperlukan disiplin ilmiah yang mandiri, yaitu: (1) mempunyai lapangan studi tertentu, (2) ada metoda, (3) ada ketepatan ilmiah, (4) ada sistem ilmiah, (5) ada kegunaan, dan (6) ada landasan falsafah.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Selanjutnya Kolonel Polisi Drs. Sanoesi yang menyatakan bahwa Ilmu Kepolisian adalah: Ilmu pengetahuan yang mempelajari gejala-gejala masyarakat dan segala usaha serta kegiatan manusia dalam rangka membina keamanan dan ketertiban. Mayor Jenderal Polisi Drs. Oetarjo Soerijawinata yang menyatakan bahwa Ilmu Kepolisian adalah: Kumpulan ilmu, yang erat hubungannya dengan tugas Kepolisian, yang diperlukan untuk peningkatan tugas Kepolisian Republik Indonesia, dalam bidang penegakan hukum dan pembinaan kamtibmas. Brigadir Jenderal Polisi Drs. Bagoes Moedajadi, SH yang menyatakan bahwa Ilmu Kepolisian adalah: Ilmu tentang tugas Polisi, baik yang menggunakan metoda ilmiah eksakta ataupun ilmu-ilmu sosial. Mayor Jenderal Polisi Drs Madjaman, SH yang menyatakan bahwa Ilmu Kepolisian adalah Ilmu yang mempelajari usaha manusia menyelamatkan dirinya terhadap gangguan manusia lain, tentang jiwa, harta benda, dan keselamatannya. Brigadir Jenderal Polisi Drs. Moersaleh M.Sc yang menyatakan bahwa Ilmu Kepolisian adalah Ilmu pengetahuan yang mempelajari sistem, metoda dan teknik tentang pengamanan dan penertiban masyarakat, baik secara keseluruhan, sebagian atau individu. Mayor Jenderal Polisi Drs. Soeparno Soeriaatmadja yang menyatakan bahwa Ilmu Kepolisian adalah: Ilmu yang mempelajari pembinaan ketertiban dan keamanan oleh suatu masyarakat/Negara dalam usaha untuk mencapai tujuannya. Brigadir Jenderal Polisi Drs. Wahjudi yang menyatakan bahwa Ilmu Kepolisian adalah: Ilmu yang menstudi tentang eksistensi, fungsi, tugas, wewenang, perkembangan polisi, serta semua ikhwal, termasuk manusia, yang mengandung pengertian polisi atau Kepolisian, melakukan fungsi Polisi/Kepolisian. Mayor Jenderal Polisi Drs. Soebadi Sastrosoedjono yang menyatakan bahwa Ilmu Kepolisian adalah: Ilmu yang mempelajari hal ikhwal kepolisian, terutama segi-segi hakekat gangguan kamtibmas, kepolisian sebagai fungsi dan organ, dengan tujuan menghasilkan pelaksanaan tugas kepolisian setinggi-tingginya. Prof. Dr. Prajudi Atmosoedirdjo, SH yang menyatakan bahwa Ilmu Kepolisian adalah: ilmu pengetahuan mengenai kepolisian, ilmu yang menjadikan kepolisian sebagai obyek studi, dan bukan ilmu pengetahuan atau pengetahuan tentang Polri (Ismail, 2015).&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Prof. Dr. Susilo Bambang Yudoyono, MA yang menyatakan bahwa Ilmu Kepolisian: Merupakan pengetahuan yang rasional tentang Ikhwal Kepolisian, yang memiliki akar metafisika dan batang logika pohon filsafat ilmu pengetahuan, Ilmu Kepolisian mempelajari masalah-masalah sosial dan isu-isu penting serta pengelolaan keteraturan sosial dan moral dalam masyarakat Indonesia, berkenaan dengan upaya-upaya memerangi kejahatan (fighting Crime), memelihara dan menjaga ketertiban umum (preservation of public order), dan melindungi warga (protecting people) terhadap ancaman bahaya dan serangan fisik (Ismail, 2015).&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Prof. Mardjono Reksodiputro, SH, MA yang menyatakan bahwa Ilmu Kepolisian adalah: ilmu yang mempelajari penegakan hukum dan pemecahan masalah sosial melalui pendekatan teori, konsep-konsep yang jelas, dengan mengembalikan pada kehidupan bermasyarakat, berbangsa dan bernegara. Ilmu Kepolisian secara garis awalnya memang multidisiplinari tetapi perlahan-lahan sudah mulai menjadi interdisiplinari sesuai harapan Prof. Parsudi Suparlan walaupun Prof. Harsja W. Bachtiar masih menganggapnya sebagai multidisciplinary. Corak antarbidang (interdisciplinary) yang didesain tersebut harus terfokus pada seperangkat pengetahuan yang nantinya akan dapat digunakan oleh lulusannya untuk digunakan sebagai acuan dalam penerapan tugas tugas profesinya. Untuk itu sebuah program pendidikan tinggi Ilmu Kepolisian yang ada di lembaga kepolisian sudah seharusnya mendesain sebuah kurikulum yang coraknya antarbidang (interdisciplinary), hal tersebut sama seperti yang diterapkan di KIK (Kajian Ilmu Kepolisian ) UI. Saat ini kurikulum yang coraknya antarbidang (interdisciplinary) terdiri atas sejumlah mata pelajaran atau mata kuliah antara satu sama lainnya saling berkaitan dan saling berhubungan, namun tetap dalam satu bingkai yang bulat dan isi dari ilmu pengetahuan tersebut berupa suatu kerangka teori yang meliputi metode dalam menganalisa serta memahami suatu permasalahan untuk penerapannya yang cocok dengan situasi serta lingkungan setempat.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\nIrjen Pol (P) Drs. Momo Kelana, M.Si mendefinisikan Ilmu Kepolisian adalah ilmu yang membahas tentang segala hal ikhwal kepolisian dan memanfaatkannya untuk kepentingan kesejahteraan manusia. Oleh sebab itu dalam metodologinya Ilmu Kepolisian secara fungsional dan sistematis menggunakan dan melibatkan disiplin ilmu-ilmu lainnya serta teknologi untuk pemecahan masalah kepolisian dalam masyarakat.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\nIrjen Pol (P) Drs. Wik Djatmika, M.Si mendefinisikan Ilmu Kepolisian sebagai ilmu yang memiliki paradigma keamanan, keteraturan, ketertiban dan penegakan hukum. Maka Ilmu Kepolisian memiliki konsep pelayanan, perlindungan dan pengayoman, serta memiliki metodologi untuk menelaah modus operandi yang bersifat tradisional sampai modern dengan mengakomodir pengaruh budaya yang bersifat universal maupun lokal.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Prof. Dr. Muhammad Mustofa menyatakan definisi Ilmu Kepolisian adalah: ilmu pengetahuan yang diperlukan oleh seorang polisi dalam melaksanakan tugas kepolisian secara profesional. Perlu diperhatikan bahwa definisi umum ini menunjukkan bahwa pekerjaan polisi adalah pekerjaan yang bersifat profesional, atau merupakan profesi seseorang. Profesi adalah suatu keahlian yang diperoleh melalui pendidikan formal yang dapat dipergunakan untuk memperoleh nafkah dengan cara memberikan jasa keahliannya tersebut kepada masyarakat.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Prof. Dr. Harsja W. Bachtiar (Dekan PTIK 1980-1987), menyatakan bahwa Ilmu Kepolisian seperti kebanyakan cabang-cabang ilmu pengetahuan yang baru, terbentuk sebagai hasil penggabungan unsur-unsur pengetahuan yang berasal dari berbagai cabang ilmu pengetahuan yang sudah lama merupakan agian dari ilmu pengetahuan, terutama pengetahuan hukum. Masing-masing cabang ilmu pengetahuan yang baru cenderung memanfaatkan pengetahuan dari sejumlah cabang ilmu pengetahuan yang telah lebih dahulu diakui sebagai cabang ilmu pengetahuan tersendiri, sehingga bisa juga ditanggapi sebagai suatu cabang ilmu pengetahuan yang bersifat antarcabang ilmu pengetahuan (interdisciplinary), sering juga disebut pengetahuan antar-bidang. Keadaan demikian berbeda daripada pengetahuan yang merupakan hasil pengkajian suatu masalah, atau perangkat masalah, yang dikaji oleh tenaga ahli dari berbagai cabang ilmu pengetahuan, masing-masing sesuai dengan kelaziman cabang ilmu pengetahuan sendiri-sendiri. Pengetahuan demikian biasanya dikenal sebagai pengetahuan multidisiplin (multidisciplinary), pengetahuan yang diperoleh melalui sejumlah pengkajian yang sesungguhnya terpisah satu dari yang lain meskipun memusatkan pada perhatian yang sama.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian lambat laun menjelma menjadi suatu cabang ilmu pengetahuan (discipline) yang baru dan yang mempunyai identitas sendiri diantara cabang-cabang ilmu pengetahuan lain yang bersama-sama merupakan ilmu pengetahuan yang diasuh oleh perguruan tinggi. Ilmu Kepolisian merupakan sebuah cabang ilmu pengetahuan yang berdiri sendiri. Ilmu Kepolisian di Indonesia sesungguhnya merupakan perpaduan dari pengetahuan yang berasal dari berbagai cabang ilmu pengetahuan (discipline).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Perpaduan ini sendiri belum terwujud sebagaimana mestinya, berbagai unsur-unsur pengetahuan masih hanya merupakan bagian dari cabang ilmu pengetahuan yang bersangkutan. Keadaan demikian adalah wajar saja dan memang dapat terjadi dalam pertumbuhan ilmu pengetahuan. Tahap perkembangan yang memperlihatkan keadaan yang sama juga pernah dilalui oleh cabang-cabang ilmu pengetahuan, seperti ilmu kedokteran, ilmu kependudukan dan kajian wilayah, yang masing-masing semula juga berasal dari cabang-cabang ilmu pengetahuan yang berbeda-beda, tapi lambat laun tumbuh menjadi satu cabang ilmu pengetahuan sendiri. Unsur-unsur pengetahuan antar cabang ilmu pengetahuan yang berasal dari cabang-cabang ilmu pengetahuan yang berbeda lambat laun, seperti halnya pada bidang kedokteran, bisa berpadu sehinga berubah menjadi bidang pengetahuan keahlian yang dng jelas mempunyai identitas sendiri, menjadi cabang ilmu pengetahuan yang sifatnya pengetahuan antarbidang.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian menghasilkan tenaga ahli ilmu kepolisian, yang tidak terbatas hanya dilakukan oleh para petugas Kepolisian sebagai profesi kepolisian. Profesi kepolisian harus dapat menjadi profesi yang diandalkan masyarakat untuk memelihara keamanan dan ketertiban umum, menangani kejahatan dan perilaku penyimpangan yang mengganggu kehidupan masyarakat, memperlancar gerak manusia dan barang, serta membantu anggota-anggota masyarakat yang memerlukan bantuan. Jenderal Polisi Prof Dr. Awaloedin Djamin, MPA, (Anggota DPRGR, 1964-1966; Menaker RI, 1966-1967 dan sekaligus Ketua Tim PAAP/cikal bakal Kemenpan RI, 1966-1968; Direktur Lembaga Administrasi Negara, 1970; Dubes RI untuk Jerman Barat, 1976-1978; Kapolri, 1978-1982; dan Dekan PTIK, 1987-2002).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian pada dasarnya adalah ilmu administrasi kepolisian. Ilmu Kepolisian merupakan sebuah bidang ilmu pengetahuan yang mempelajari masalah-masalah sosial &nbsp; &nbsp; &nbsp; &nbsp; dan masalah-masalah kepolisian dalam rangka pelaksanaan tugas Kepolisian guna mewujudkan keteraturan sosial. Ilmu Kepolisian merupakan sebuah bidang Ilmu pengetahuan yang bercorak multidisipliner yang mencakup konsep dan teori dari Ilmu eksakta atau alamiah, Ilmu Sosial dan Ilmu Humaniora. Ilmu Kepolisian sebagai ilmu Administrasi Kepolisian dapat dikelompokan menjadi 4 bagian besar yaitu (1) kelompok ilmu sosial; (2) kelompok ilmu hukum; (3) Kelompok ilmu administrasi dan manajemen dan (4) Kelompok ilmu-ilmu pendukung lainnya.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian dikembangkan oleh Perguruan Tinggi Ilmu Kepolisian sejak tahun 1950 dan Universitas Indonesia sejak tahun 1996 dengan membentuk Program Pascasarjana Studi Kajian Ilmu Kepolisian (KIK) yang diutamakan sebagai pendidikan lanjutan Ilmu Kepolisian untuk para perwira Polri lulusan PTIK yang belum memiliki jenjang pascasarjana saat itu, meskipun dapat juga diikuti oleh umum.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Program Pascasarjana Studi Kajian Ilmu Kepolisian (KIK) di Universitas Indonesia mendidik Strata-2 untuk Magister Sains (M.Si) dan selanjutnya berkembang pada Strata-3 Doktor (Dr.).&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Program sarjana Ilmu Kepolisian PTIK hanya memiliki satu jurusan yaitu Administrasi Kepolisian yang memberikan kompetensi police general managers dan police functional managers untuk tingkat Polres. Sedangkan untuk Strata-2 dan 3 KIK UI dapat dibuat kekhususan Administrasi Kepolisian, Hukum Kepolisian dan Manajemen Sekuriti.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian sebagai Ilmu administrasi kepolisian melakukan pengkajian tentang membangun dan memantapkan organisasi dan pranata-pranata kepolisian, kebudayaan dan etika kepolisian, manajemen personil, birokrasi dan keuangan sesuai kebutuhan masyarakat untuk dapat menciptakan rasa aman dan keteraturan sosial, mengayomi dan melindungi masyarakat dan warga serta harta benda mereka, mencegah terjadinya dan memerangi kejahatan, menindak secara adil berbagai pelanggaran hukum dan kejahatan yang dilakukan oleh perorangan ataupun kelompok sesuai dengan hukum yang berlaku.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Prof. Parsudi Suparlan, Ph.D, (Dosen PTIK dan Kajian Ilmu Kepolisian Universitas Indonesia, 1996-2007). Ilmu Kepolisian merupakan sebuah bidang ilmu yang corak pendekatannya antarbidang (interdisciplinary) yang memiliki paradigma sendiri yang mencakup metodologi, teori-teori, konsep-konsep, metode-metode dan bahkan label-label yang khusus menjadi ciri-cirinya yang berbeda dari metodologi atau paradigma dan pendekatan antarbidang atau sesuatu. Ilmu Kepolisian mempelajari masalah-masalah sosial dan isu-isu penting serta pengelolaan keteraturan sosial dan moral dari masyarakat, upaya-upaya penegakan hukum dan keadilan, dan teknik-teknik penyidikan dan penyelidikan berbagai tindak kejahatan serta cara- cara pencegahannya.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian dapat juga dinamakan Kajian Kepolisian, Kajian Kepolisian adalah kegiatan-kegiatan ilmiah yang biasanya diselenggarakan dalam pranata-pranata pendidikan atau dalam kegiatan-kegiatan penelitian. Oleh karena itu, Ilmu Kepolisian didefinisikan sebagai &rdquo;sebuah bidang ilmu pengetahuan yang mempelajari masalah-masalah sosial dan isu-isu penting serta pengelolaan keteraturan sosial dan moral dari masyarakat, mempelajari upaya-upaya penegakan hukum dan keadilan, dan mempelajari teknik-teknik penyelidikan dan penyidikan diberbagai tindaknya kejahatan serta cara-cara pencegahannya&rdquo;.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Definisi tersebut perlu dijabarkan dan dapat dioperasionalkan dalam upaya pengembangan kurikulum sesuai dengan fungsi polisi dalam masyarakat dan tugas-tugas. Adapun hal tersebut diatas menjabarkannya adalah sebuah bidang ilmu pengetahuan. Sebagai sebuah bidang ilmu pengetahuan maka Ilmu Kepolisian mempunyai paradigma atau sebuah sudut pandang ilmiah yang mencakup epistemologi, ontologi, aksiologi dan metodologi, yang mempersatukan berbagai unsur-unsur yang tercakup di dalamnya sebagai sebuah sistem yang bulat dan menyeluruh.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Paradigma yang ada dalam Ilmu Kepolisian adalah antar-bidang (interdiscplinary). Jadi Ilmu Kepolisian tidak seharusnya mempunyai paradigma yang multi-bidang (multidisplinary) sebagaimana dikemukakan oleh Prof. Harsja W Bachtiar. Sebab, kalau pendekatannya adalah multi-bidang maka ilmu-Ilmu Kepolisian hanya merupakan penggabungan berbagai bidang ilmu pengetahuan melalui berbagai bidang pengajaran dalam sebuah kurikulum yang masing masing berdiri sendiri dan tidak ada kaitan antara satu dengan lainnya.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Jenderal Polisi Dr. Chairudin Ismail (2014), obyek studi Ilmu Kepolisian berkaitan erat dengan tujuan diadakannya organ kepolisian di dalam suatu masyarakat negara. Tujuan itu adalah untuk mewujudkan ketertiban dan ketentraman di dalam masyarakat (public safety) yang di Amerika Serikat dirumuskan dengan kalimat domestic tranquility. Karena itu sasaran perhatian Ilmu Kepolisian ditujukan kepada segala bahaya yang mengancam ketertiban dan ketentraman masyarakat tersebut yang lazim disebut sebagai community hazard, yang terwujud sebagai: (1) kejahatan atau pelanggaran (crimes) yang melanggar hukum (unlawfull act) baik hukum pidana maupun pidana adat yang masih diakui dan berlaku di berbagai lingkungan masyarakat, serta berbagai pidana internasional yang telah diratifikasi oleh Undang-undang nasional; (2) pelanggaran terhadap norma-norma kesusilaan atau kelakukan yang dipandang tidak senonoh oleh warga masyarakat lokalitas (misconduct), seperti penyakit-penyakit masyarakat (penggunaan minuman keras tanpa ijin, atau mabuk-mabukan di tempat umum, pelacuran, pengemisan di jalan, dan seterusnya); dan (3) segala keadaan yang dapat mengganggu ketertiban (disorder) seperti kesemerawutan lalu lintas, merokok di lingkungan Pom Bensin yang dapat menimbulkan kebakaran dan seterusnya. Termasuk disini adalah bencana, baik disebabkan oleh alam maupun manusia (disaster, bencana kereta api, kapal dan seterusnya).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Karena bahaya dan gangguan tersebut bersumber dan ditujukan kepada masyarakat, dan merupakan pekerjaan kepolisian untuk mengatasinya, maka secara umum objek dari Ilmu Kepolisian adalah warga masyarakat, baik secara perorangan maupun kelompok, termasuk lembaga-lembaga penyelenggara fungsi kepolisian tersebut. Objek tersebut seringkali disebut sebagai permasalahan sosial (social problems) atau secara lebih fokus pada community hazard, yang berkenaan dengan upaya-upaya memerangi kejahatan (fighting crime), memelihara keamanan dan ketertiban masyarakat (preservation of law and order) dan melindungi warga (protecting people) terhadap bahaya dan gangguan tersebut.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Sebagai Ilmu terapan, Ilmu Kepolisian tidak menjelaskan dan menerangkan &ndash; eksplanasi &ndash; tentang objek tersebut, tetapi menggambarkan &ndash; deskripsi &ndash; tentang bagaimana caranya untuk menyelematkan umat manusia dari bahaya dan gangguan tersebut, melalui upaya pencegahan dan/atau penindakan. Ilmu pengetahuan murni (pure science/basic science) telah dan terus menjelaskan dan menerangkan hubungan sebab akibat seluruh fenomena di dalam jagat raya ini, termasuk mengenai objek-objek tersebut beserta faktor-faktor yang berkaitan dengannya. Ilmu Kepolisian tidak masuk sampai ke sasaran semacam itu, namun ia melanjutkan memanfaatkan ajaran Ilmu-ilmu pengetahuan murni tersebut, sehingga benar-benar dirasakan manfaatnya oleh umat manusia.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dengan demikian, komponen-komponen ilmu pengetahuan yang secara terpadumembentuk Ilmu Kepolisian, yang secara terus-menerus berupaya memperkuat dan mempertinggi kualitas profesional profesi kepolisian sesuai dengan tradisi masyarakat bangsa dimana ia berkembang. Sama seperti keterpaduan Patologi, Ginekologi, Ilmu penyakit dalam, ilmu obat-obatan dan seterusnya secara terpadu mewujudkan ilmu kedokteran. Komponen-komponen tersebut lambat laun akan mewujudkan keahlian khusus (spesialisasi-spesialisasi) di bidang pekerjaan kepolisian, yang dikembangkan melalui pengkajian dan penelitian. Komponen-komponen ilmu pengetahuan tersebut meskipun semua menggunakan konsep-konsep, teori-teori dan/atau penjelesan ilmu pengetahuan lainnya, namun ia tetap memiliki batas-batas yang mencirikan sebagai ilmu yang mandiri. Hal ini juga terjadi pada komponen-komponen ilmu kedokteran, misalnya Patologi yang memanfaatkan ilmu-ilmu lain berupa Fisiologi, Fisika, Kimia, Biologi, Psikologi dan lain-lain, namun ia tetap memiliki batas-batas yang membedakannya dengan ilmu-ilmu yang telah dimanfaatkan tadi.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian berkenaan dengan penegakan hukum dan keadilan, khususnya menyangkut teknik-teknik dan penyidikan berbagai tindak kejahatan serta cara-cara pencegahan dan penanggulangannya. Hal itu melibatkan manusia dan perilaku serta keinginannya, yang hanya dapat dipahami secara rasional melalui pendekatan ilmu-ilmu sosial dan humaniora sedangkan ilmu-ilmu alamiah berkenaan dengan msalah pembuktian untuk menemukan physical evidence, sehingga pendekatan interdisipliner sangat diperlukan, Ilmu Kepolisian tidak terlepas dari rumusan tugas dan fungsi kepolisian di Indonesia yang tercantum dalam UUD 1945 dan UU No. 2 tahun 2002 tentang Polri, yakni : &ldquo;memelihara keamanan dan ketertiban masyarakat, menegakkan hukum, melakukan perlindungan, pengayoman dan pelayanan masyarakat, Rumusan tersebut pada hakekatnya meliputi 3 (tiga) fungsi utama yang menjadi bisnis inti kepolisian di Indonesia, meliputi : (1) fungsi memerangi kejahatan (fighting crime); (2) fungsi memelihara ketertiban umum; dan (3) fungsi melindungi warga dari serangan dan/atau ancaman bahaya fisik (protecting people).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Inspektur Jenderal Polisi Prof. Dr. Farouk Muhammad (mantan Gubernur STIK- PTIK, Guru Besar Ilmu Kepolisian dan Sistem Peradilan Pidana pada STIK-PTIK). Upaya pengembangan ilmu kepolisian seperti yang dilakukan rekan-rekan kita di Amerika Serikat seyogyanya ditiru dan hasil-hasil risetnya perlu diuji di negeri kita. Kita harus mulai dengan meneliti fenomena-fenomena kepolisian guna menemukan generalisasi-generalisasi dalam bentuk pernyataan-pernyataan ilmiah yang sudah barang tentu dikaitkan dengan teori-teori yang valid dari disiplin ilmu yang terkait. Perangkat pengetahuan demikianlah yang kita butuhkan untuk memahami polisi dan kepolisian, dan untuk mengambil langkah-langkah perbaikan guna peningkatan kinerja kepolisian, sehingga keberadaan ilmu kepolisian sesuai tujuan ilmu pengetahuan, benar-benar dirasakan manfaatnya bagi kesejahteraan masyarakat.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Bagi saya, ilmu kepolisian adalah bidang studi terapan yang mempelajari fenomena sosial yang berkenaan dengan masalah kepolisian dan memadukannya dengan teori dan hasil studi disiplin ilmu terkait (sosiologi/kriminologi, hukum, ekonomi/manajemen, administrasi negara serta ilmu-ilmu lain seperti psikologi, antropologi dan lain-lain). Dalam perkembangannya hingga dewasa ini, aspek-aspek beberapa disiplin ilmiah yang telah turut menggarap permasalahannya belum mampu untuk meleburkan diri secara sempurna ke dalam satu pengertian ilmiah yang disebut ilmu kepolisian. Seperti halnya diibaratkan kendaraan, maka sebagian suku cadangnya masih memakai merk dari pabriknya yang asli, belum meleburkan diri sehingga merupakan bagian yang utuh dari kendaraan baru.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu kepolisian sebagai ilmu terapan memang membutuhkan teori-teori dari ilmu-ilmu yang mendukungnya tetapi teori-teori tersebut perlu lebih dahulu melalui proses ilmiah, proses penelitian ilmiah. Kelemahan dalam bidang inilah terutama yang dihadapi oleh ilmu kepolisian di Indonesia.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Selanjutnya Ilmu Kepolisian juga dijelaskan dalam beberapa buku dan makalah ilmiah dari alumni Doktor Ilmu Kepolisian Universitas Indonesia, antara lain :&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Komisaris Besar Polisi Dr. Chryshnanda Dwilaksana, M.Si, (Dosen KIK-UI dan PTIK, sejak 2001; Alumni KIK-UI 2005). Polisi tatkala menjadi profesi maka diperlukan ilmu yang melandasi/mendukung. Ilmu Kepolisian dipelajari dan dikembangkan dari pekerjaan dan apa yang dikerjakan oleh polisi di masyarakat maupun dalam institusi kepolisian. Benang merah Ilmu Kepolisian secara epistemologi, ontologi, metodologi dan aksiologinya adalah pada keamanan dan rasa aman. Polisi bekerja dalam institusi maupun masyarakatnya melalui pemolisian yang modelnya dapat dikategorikan dalam model wilayah, model fungsional/kepentingan, model penanganan dampak masalah. Pada hakekatnya keberadaan polisi dalam masyarakat adalah karena adanya kebutuhan masyarakat adanya layanan kepolisian, sebagai penjaga kehidupan, pembangun peradaban, dan pejuang kemanusiaan.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Inspektur Jenderal Polisi Dr. H. Rycko Amelza Dahniel, M.Si (Alumni KIK-UI, 2008; Dosen KIK-UI dan PTIK, sejak 2008; Gubernur PTIK/Ketua STIK, sejak 2014). Ilmu Kepolisian merupakan sebuah bidang ilmu pengetahuan yang mempelajari fungsi dan lembaga kepolisian dalam mengelola masalah-masalah sosial guna mewujudkan keteraturan sosial. Sebagai sebuah bidang ilmu pengetahuan yang berdiri sendiri, dengan demikian corak pendekatannya harus interdisiplin, memiliki paradigma sendiri yang terbentuk secara epistemologi bercorak akumulatif dan eklektis.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Pendekatan antar-bidang secara sederhana merupakan sebuah pendekatan atau sudut pandang yang digunakan sebagai acuan untuk meramu sejumlah konsep untuk menjadi teori atau teori-teori. Hasil ramuan atau teori tersebut digunakan sebagai kerangka acuan atau pedoman bagi memahami sesuatu masalah yang menjadi perhatian untuk dapat ditangani secara benar dan menyeluruh. Untuk mampu membuat kerangka acuan tersebut diperlukan kemampuan untuk menyeleksi konsep-konsep relevan dan menggunakan hakekat hubungan konsep-konsep yang terseleksi tersebut untuk memahami masalah yang dihadapi, menguji kesimpulan dari pemahamannya, apakah sudah benar atau belum, sebab bila tidak benar, maka teori yang dibuat itu salah dan harus diulang lagi dengan pembuatan teori yang baru.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Hakekat epistemologi Ilmu Kepolisian sebagai sebuah bidang ilmu pengetahuan yang multi-bidang atau antar-bidang tidak perlu dipertentangkan karena merupakan sebuah keniscayaaan alamiah dari sebuah evolusi ilmu pengetahuan yang coraknya akumulatif dan pengayaan epistemologis yang bercorak eklektis. Lebih dari itu sebagai sebuah bidang ilmu pengetahuan juga harus mencakup kajian empirik atas ontologi dan aksiologi, termasuk metodologinya. Eksistensi Ilmu Kepolisian harus ditunjukkan dengan adanya lembaga ilmiah untuk pengembangannya, memiliki perkumpulan ilmuwan dengan berbagai produk ilmiah yang terpublikasi secara periodik guna peningkatan kualitas umat manusia (the guardian to enhance quality of life, the guardian to humanity, the guardian to civilization).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Bakharudin Muhammad Syah, M.Si. (alumni KIK-UI, 2008, Dosen KIK-UI, 2008, dan Dosen utama PTIK, 2015). Ilmu Kepolisian merupakan ilmu terapan. Sebagai sebuah ilmu terapan (profesi) Ilmu Kepolisian mementingkan kajiannya pada identifikasi masalah-masalah dan pemecahan secara profesional. Secara lebih luas Ilmu Kepolisian dapat didefenisikan sebagai sebuah bidang ilmu pengetahuan yang mempelajari masalah-masalah sosial dan isu-isu penting serta pengelolaan keteraturan sosial dan moral masyarakat, mempelajari upaya-upaya penegakan hukum dan keadilan, serta mempelajari tehnik-teknik penyidikan dan penyelidikan berbagai tindak kejahatan serta cara-cara pencegahannya.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dan, oleh karena itu pendekatan metodologi yang digunakan adalah pendekatan antarbidang (interdisciplinary approach), meskipun pendekatan mono-bidang maupun yang multi-bidang juga digunakan. Bidang ilmu pengetahuan ini berangkat dari suatu paradigma, yang pada hakekatnya berupa sudut pandang dan keyakinan-keyakinan ilmiah. Tercakup dalam paradigma tersebut adalah metodologi dan metode-metodenya, sasaran kajiannya, konsep- konsep serta teori-teori yang digunakan, dihasilkan, maupun yang dipinjam (ekletik) dari bidang/kajian ilmu pengetahuan lainnya. Dan, yang sebenarnya ditujukan guna memperkuat pengembangan Ilmu Kepolisian sebagai applied science (ilmu pengetahuan terapan). Berdasarkan pemahaman tentang Ilmu Kepolisian terurai di atas maka sebagai sebuah bidang ilmu pengetahuan terapan, bukan hanya pendekatannya yang mempengaruhi perkembangan Ilmu Kepolisian sebagai ilmu pengetahuan, melainkan juga masalah-masalah dan isu-isu sosial dimana polisi itu berfungsi. Tepatnya, konteks masayarakat dan kebudayaan yang multikultural dimana polisi itu berfungsi merupakan isu kritikal dalam menilai berfungsi atau tidaknya polisi sebagai sebuah pranata otonom dan sebagai organisasi pengayom masyarakat serta penegak hukum. Multikulturalisme adalah sebuah ideologi yang menghargai &nbsp; &nbsp; perbedaan &nbsp; &nbsp; &nbsp;dalam &nbsp; &nbsp; kesederajatan. &nbsp; &nbsp; &nbsp;Fenomena &nbsp; &nbsp; yang &nbsp; &nbsp;menonjol &nbsp; &nbsp; yang &nbsp; &nbsp; tampak &nbsp;dalamn multikulturalisme antara lain: (a) pengakuan atas adanya perbedaan dalam kehidupan manusia, terutama perbedaan askriptif: (b) pengakuan serta penghormatan terhadap kesedarajatan dan perbedaan-perbedaan tersebut.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Pemahaman maupun penguasaan tentang konsep-konsep kunci dan teori-teori maupun metodologi untuk memahami maupun mengkaji lingkup masyarakat multikultural sangat diperlukan untuk memahami maupun menjelaskan keberadaan masyarakat multikultural sangat diperlukan. Penguasaan konsep maupun teori-teori terkait mendorong pelaksanaan pemolisian yang berkualitas, dan terbebas dari prasangka melakukan tindakan diskriminatif sesuai dengan streotip dan prasangka yang dimilikinya, sehingga hal tersebut diatas Ilmu Kepolisian mengajarkan kepada seluruh anggota polisi untuk dapat memilih konsep dan teori yang relevan dengan permasalahan dimana polisi bertugas.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Pandangan tentang Ilmu Kepolisian juga disampaikan oleh beberapa Dosen Sekolah Tinggi Ilmu Kepolisian - PTIK, antara lain:\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Albertus Wahyurudhanto, M.Si (doktor ilmu pemerintahan, dosen STIK-PTIK sejak 2003). Pemaknaan Ilmu Kepolisian tidak bisa dilepaskan dari fungsi kepolisian secara universal yaitu &ldquo;to protect and to serve&rdquo;. Fungsi ini pada hakikatnya adalah salah satu fungsi negara, yaitu untuk memberikan jaminan rasa aman dan keamanan bagi warga negara, yang dalam tata kelola negara dilakukan oleh pemerintah. Dalam Undang-Undang Kepolisian Negara RI (UU Nomor 2 Tahun 2002), pengakuan tersebut juga ada dengan penegasan adanya frasa bahwa fungsi kepolisian adalah satu fungsi pemerintahan negara.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ini berarti bahwa pengakuan fungsi kepolisian sebagai organ negara, menunjukkan bahwa Ilmu Kepolisian adalah ilmu yang mempelajari segala hal ikhwal yang berkaitan dengan memberikan rasa aman dan keamanan bagi warga negara oleh negara. Lingkup bahasan Ilmu Kepolisian dengan demikian harus selaras dengan lingkup pembahasan tentang penyelenggara negara, yaitu pemerintah sebagai pemegang mandat penyelenggara negara, namun Ilmu Kepolisian dibatasi pada bahasan tentang fungsi memberikan rasa aman dan keamanan warga negara, baik dalam &nbsp;studi mengenai pengkondisian maupun pemeliharaan bagi rasa aman dan keamanan warga negara. Sehingga Ilmu Kepolisian pada hakikatnya adalah bagian dari ilmu negara yang secara khusus mempelajari mengenai peran memberikan rasa aman dan mewujudkan keamanan.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Sutrisno (doktor ilmu sosiologi, dosen STIK-PTIK sejak 2003). Ilmu Kepolisian adalah sebuah disiplin atau ilmu yang mempelajari segala bentuk kegiatan mengenai penyelenggaraan atas pemberian rasa aman kepada masyarakat. Definisi ini mempunyai keluasan yang bersifat relatif. Term tentang &ldquo;segala bentuk kegiatan&rdquo; merujuk pada sebuah pengertian mengenai mekanisme atau tata kelola aktor-aktor/organisasi yang terlibat dan aktivitas yang dilakukannya dalam penyelenggaraan memberian rasa aman; termasuk didalamanya cara bertindak (kegiatan teknis) yang bersifat personal.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Klausul tentang &ldquo;Penyelenggaraan atas pemberian rasa aman&rdquo; (the hold-providing of secure) merupakan subject matter Ilmu Kepolisian ini. Hidup dan berkembangnya Ilmu Kepolisian terletak dalam cara mempertanyakan terus menerus secara kritis dan metodik tentang &ldquo;Penyelenggaraan atas pemberian rasa aman&rdquo; sebagai subject matter &ndash;nya. Secara simplistis, kritisisme dan metode pemberian atas rasa aman ini ber-trialektika antara struktur, kultur, dan proses.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Konsep &ldquo;masyarakat&rdquo; pada definisi di atas menunjukkan &ldquo;batasan&rdquo; obyek studi Ilmu Kepolisian, selain juga mengandung makna keluasan ruang lingkup kajiannya. Term &ldquo;masyarakat&rdquo; ini penting untuk menegasakan batasan bahwa aktor penyelenggara keamanan hanya bekerja pada ruang publik, bukan privat (individu). Term &ldquo;masyarakat&rdquo; pada dasarnya sebuah konsep abstrak yang mengantonimkan makna &ldquo;privat/individu&rdquo;, untuk menegaskan masyarakat berbeda dengan crowd. Term &ldquo;masyarakat&rdquo; mengacu pada sebuah gejala hubungan/ interaksi yang berpola (pattern).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Ilham Prisgunanto, M.Si (doktor ilmu komunikasi, dosen STIK-PTIK sejak 2003). Aklamasi kepolisian sebagai ilmu adalah sebuah pernyataan bersama berbagai ahli berbagai bidang yang mengakui bahwa Ilmu Kepolisian itu ada. Ilmu Kepolisian seperti layaknya ilmu- ilmu lain hadir dalam tataran praktis yang kemudian masuk dalam ranah keilmiahan. Kehadiran Ilmu Kepolisian sebenarnya serupa dengan ilmu komunikasi dan ilmu perpustakaan dan informasi yang mana pada kedua ilmu tersebut penulis bergelut dalam perjalanan pengembaraan akademis.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Kesadaran ada dimana ilmu yang digeluti menjadi problematika penting dalam upaya seorang ilmuwan mengarahkan temuan dan pengembangan dirinya ke depan. Oleh sebab itu klaim-klaim paradigma dalam Ilmu Kepolisian bukanlah sesuatu yang mengerikan dan perlu dihindari, malah disyukuri sebagai sebuah rahmat bahwa sedemikian kompleksnya dinamika perkembangan Ilmu Kepolisian dan besarnya perhatian semua pihak pada ilmu ini.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Yopik Gani, M.Si (doktor ilmu administrasi publik, dosen STIK-PTIK sejak 2003). Ilmu Kepolisian adalah ilmu administrasi kepolisian yang bersifat interdisipliner, secara normatif dapat dikemukakan bahwa pemikiran tentang administrasi kepolisian tentunya haruslah bermula dengan ilmu administrasi Negara sebagai locus-nya. Hal ini secara eksplisit dijelaskan dalam Pasal 2, Undang-undang No. 2 Tahun 2002, tentang Kepolisian Negara Republik Indonesia, bahwa &ldquo;fungsi kepolisian adalah salah satu fungsi pemerintahan negara di bidang pemeliharaan keamanan dan ketertiban masyarakat, penegakan hukum, perlindungan, pengayoman, dan pelayanan kepada masyarakat&rdquo;.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Kalimat &ldquo;fungsi kepolisian adalah salah satu fungsi pemerintahan negara&rdquo;, dapat diartikan bahwa Polri adalah salah satu subsistem birokrasi pemerintahan negara dan logis jika kemudian dianggap bahwa birokrasi merupakan subyek penting bagi mereka yang mempelajari ilmu administrasi kepolisian. Berkait hal itu, maka secara normatif, ilmu administrasi negara adalah disiplin induk administrasi kepolisian. Oleh karena itu tidaklah berlebihan jika dikatakan, bahwa secara tradisional ilmu administrasi negara telah menjadi fokus pertimbangan yang paling lengkap dari pemikiran filosofis dan normatif dalam administrasi kepolisian atau Ilmu Kepolisian. Namun, Ilmu Kepolisian atau administrasi kepolisian telah senantiasa lebih sekaligus kurang daripada ilmu administrasi negara.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Supardi Hamid, M.Si (doktor ilmu kriminologi, Dosen STIK-PTIK sejak 2003). Dalam masyarakat yang bercirikan solidaritas mekanis, mekanisme kontrol sosial dijalankan oleh kolektif masyarakat dan diaktivasi pada saat terjadinya penyimpangan. Dalam masyarakat modern yang dicirikan oleh solidaritas yang bersifat organis, mekanisme kontrol sosial sepenuhnya dijalankan oleh lembaga atau &nbsp;organ masyarakat yang bersifat khusus. Bentuk nyata lembaga semacam ini diantaranya adalah lembaga kepolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Kepolisian sebagai sebuah organ dalam masyarakat yang menjalankan fungsi kontrol sosial dijalankan melalui pranata kepolisian yang kompleksitasnya mengikuti kompleksitas sistem sosial masyarakat tersebut. Sebagai sebuah pranata yang kompleks, yang dijalankan oleh orang-orang yang memiliki kualifikasi tertentu dan diberikan atribut kewenangan untuk menciptakan keteraturan (order) dalam kehidupan masyarakat, kepolisian kemudian menjadi perangkat pengetahuan dan praktik yang kompleks. Sebagai bentuk respons terhadap situasi yang mengancam keteraturan, kepolisian juga bersifat &nbsp;dinamis, adaptif, dan responsif selaras dengan dinamika masyarakat. Hal ini menyebabkan kepolisian membutuhkan kajian yang terus menerus dan menjadi pengetahuan yang bersifat akumulatif. Kepolisian menjadi sebuah cabang ilmu pengetahuan tersendiri.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian (police science) merupakan ilmu pengetahuan yang mempelajari segala bentuk ancaman terhadap keteraturan (order) dalam kehidupan masyarakat serta cara-cara menciptakan keteraturan sosial yang dilakukan oleh pengemban fungsi kepolisian, pengorganisasian dan pengelolaan lembaga kepolisian dalam kehidupan masyarakat.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dr. Vita Mayastinasari, M.Si (doktor manajemen sumber daya manusia, dosen STIK- PTIK sejak 2013) : Ilmu Kepolisian adalah ilmu yang berperan dalam penataan masyarakat agar terwujud kondusivitas situasi keamanan masyarakat, sekaligus ilmu yang mempelajari strategi mengantisipasi berbagai permasalahan yang berkembang ditengah-tengah masyarakat. Ilmu Kepolisian dapat digunakan untuk memecahkan berbagai permasalahan sosial kemasyarakatan, termasuk berbagai perilaku penyimpangan sosial dalam masyarakat.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian juga sangat bermanfaat dalam perencanaan penanganan berbagai tindakan hukum agar terwujud harmonisasi kepastian hukum, kemanfaatan hukum dan rasa keadilan terhadap penanganan hukum. Peran Ilmu Kepolisian dalam kemanusiaan mencakup pemberdayaan masyarakat untuk bertanggung jawab terhadap keamanan individu, kelompok masyarakat dan negara. Ilmu Kepolisian adalah ilmu yang mempelajari pendekatan sistem yang sistematis, sistemik dan terintegrasi antar berbagai komponen sosial kemasyarakatan agar terwujud keteraturan sosial.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Syah Firman Fadillah dan Tety Machyawaty dalam buku Lex Specialis Ilmu Kepolisian (2015) menuliskan bahwa, Ilmu Kepolisian adalah ilmu pengetahuan yang melayani, mengayomi, dan melindungi ilmu pengetahuan lainnya untuk dapat bekerja pada hal-hal yang dikelola kepolisian, Ilmu Kepolisian tidak terikat pada sedikit, atau banyak ilmu pengetahuan, dan tidak terpengaruh oleh berkembang, atau tidaknya ilmu pengetahuan lainnya, tetapi terbuka terhadap ilmu pengetahuan apa saja, dalam jumlah berapa saja, dan dalam perkembangan bagaimana saja yang bisa bekerja pada waktu yang tepat, tempat yang tepat, hal yang tepat yang dikelola oleh kepolisian, sehingga Ilmu Kepolisian adalah transdisipliner. Konsep lain untuk memvisualisasikan transdisipliner Ilmu Kepolisian sebagai adalah melalui sebuah jam dinding yang jarumnya bergerak (bekerja) terus menerus pada porosnya, dan pada saat ditemukan ketepatan hubungan antara jarum-jarum (ketepatan antara ilmu pengetahuan yang diperlukan dengan hal hal yang dikelola oleh kepolisian), maka jam tersebut akan mengeluarkan suara (pengelolaan suatu hal telah selesai), dan jarum jam bergerak kembali.\r\n</div>\r\n<div style="text-align: justify">\r\n<br />\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span><font color="#0000ff"><strong>Ilmu Kepolisian</strong></font>\r\n</div>\r\n<div style="text-align: justify">\r\n&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Memahami pandangan dan pendapat para pemikir Ilmu Kepolisian di atas menunjukkan betapa Ilmu Kepolisian merupakan ilmu yang hidup terus tumbuh berkembang dan memiliki keluasan cakupan untuk dikaji. Pandangan para pakar dan pemikir Ilmu Kepolisian yang dipengaruhi latar belakang pengetahuan dan pengalamanya dapat dikategorikan pemikiran yang berdasarkan pengalaman kerja atau melihat dari sudut apa yang dikerjakan polisi (ini pun masih dipengaruhi dari pendekatan pengalaman kerjanya di bidang penegakan hukum maupun tugas- tugas staf/administrasi).\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Pendekatan para pakar dalam mengkaji Ilmu Kepolisianpun dipengaruhi keilmuan yang menjadi keahliannya, pakar administrasi misalnya Prof Awaloedin Djamin pendekatan administrasi menjadi landasan bagi pengkajian Ilmu Kepolisian. Profesor Harsja Bachtiar sebagai sosiolog mengkaji dari pendekatan-pendekatan sosiologi, Profesor Parsudi melihat dari pendekatan antropologi yang menekankan pada apa yang menjadi kebutuhan masyarakat untuk mendapatkan pelayanan kepolisian, dan manfaatnya bagi masyarakat. Berbagai pendekatan para pejuang Ilmu Kepolisian telah mewarnai perjalanan perkembangan Ilmu Kepolisian di Indonesia yang menunjukkan bahwa pekerjaan-pekerjaan polisi semakin lama semakin kompleks yang menuntut adanya petugas-petugas polisi yang profesional.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dengan demikian dapat dipahami bahwa kebutuhan masyarakat akan adanya pelayanan kepolisian dalam masyarakat yang modern adalah pada upaya-upaya pelayanan, perlindungan dan pengayoman agar terjaganya produktifitas masyarakat. untuk dapat hidup tumbuh dan berkembangnya suatu masyarakat diperlukan adanya produktifitas. Produktifitas tersebut dihasilkan dari aktivitas-aktivitas dan dalam kenyataanya, dalam proses aktivitas untuk menghasilkan produksi-produksi ada tantangan, hambatan, gangguan bahkan ancaman yang dapat menghambat, merusak bahkan mematikan produktifitas. Untuk melindungi harkat dan martabat manusia yang berproduksi diperlukan aturan, norma, etika, hukum. Untuk menegakkan dan mengajak masyarakat mentaatinya diperlukan institusi yang menangani, salah satunya adalah polisi.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Tatkala polisi dinyatakan sebagai ilmu pengetahuan, maka Ilmu Kepolisian secara filsafat ilmu memiliki paradigma yang berbeda dengan ilmu-ilmu lainnya. Ilmu Kepolisian sebagai ilmu pengetahuan paradigma dalam mengkaji untuk &nbsp;menyelidiki, menemukan, dan &nbsp;meningkatkan pemahaman dari berbagai sudut pandang yang menunjukkan adanya rumusan-rumusan bahwa Ilmu Kepolisian sebagai ilmu antarbidang yang mempelajari dan mengkaji tentang masalah-masalah sosial, pengelolaan keteraturan sosial, isu-isu penting yang terjadi dalam masyarakat, hukum dan keadilan dan penegakanya, penanganan dan pencegahan kejahatan (kriminalitas). Untuk membangun institusi kepolisian yang profesional yang mampu mengatasi permasalahan yang terjadi dalam masyarakat Ilmu Kepolisianpun mengkaji bidang administrasi dan birokrasi dan teknis-teknis kepolisian. Benang merah pengkajian Ilmu Kepolisian adalah pada pemolisian yaitu segala usaha/upaya polisi untuk mewujudkan dan memelihara keteraturan sosial, mengatasi masalah-masalah sosial, isu-isu penting, menegakan hukum dan keadilan, menyelidiki dan menyidik tindak pidana dan berbagai upaya pencegahanya, pada tingkat manajemen maupun operasional, dengan/tanpa upaya paksa. Dengan demikian dapat ditunjukkan bahwa polisi bekerja melalui pemolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian bukan sekadar pengetahuan (knowledge), tetapi merangkum sekumpulan pengetahuan berdasarkan teori-teori yang disepakati dan dapat secara sistematik diuji dengan seperangkat metode yang diakui dan relevan untuk dapat digunakan dalam mengkaji berbagai bidang yang menjadi perhatian/yang dikaji dalam Ilmu Kepolisian. Dipandang dari sudut filsafat, Ilmu Kepolisian terbentuk karena menyadari bahwa tugas polisi adalah profesional, dan mengkaji berbagai model cara-cara polisi bekerja dan tugas-tugas yang dihadapi polisi dan harapan masyarakat melalui pemolisian sebagai produk dari epistemologinya. Sifat ilmiah Ilmu Kepolisian sebagai persyaratan ilmu pengetahuan banyak terpengaruh paradigma ilmu- ilmu pengetahuan yang telah ada lebih dahulu menjadi: hukum kepolisian, sosiologi kepolisian, antropologi kepolisian, administrasi kepolisian, politik kepolisian, ekonomi kepolisian, forensik kepolisian dan sebagainya. Pada awalnya Ilmu Kepolisian sebagai ilmu yang multibidang dengan menggunakan paradigma ilmu-ilmu terdahulu, sehingga epistemologi, ontologi, metodologi serta aksiologinya mengacu pada ilmu terdahulu yang menjadi pokok/intinya.&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Ilmu Kepolisian memiliki objek kajian yang merupakan benang merah dari epistemologi, ontologi dan metodologi serta aksiologinya, terdiri dari satu golongan masalah yang sama sifat hakikatnya, tampak dari luar maupun bentuknya dari dalam yaitu keamanan dan rasa aman. Keamanan dan rasa aman dapat dikaji dari berbagai sudut dengan objeknya yang bersifat ada, dan masih harus terus diuji keberadaannya. Dalam mengkaji objek Ilmu Kepolisian, yang dicari adalah kebenaran, yakni persesuaian antara tahu dengan objek, sehingga disebut kebenaran objektif; bukan subjektif berdasarkan subjek peneliti atau subjek penunjang penelitian. Metodis adalah upaya-upaya yang dilakukan untuk meminimalisasi kemungkinan terjadinya penyimpangan dalam mencari kebenaran yang &nbsp;merujuk pada metode ilmiah, sistematis terurai dan terumuskan dalam hubungan yang teratur dan logis sehingga membentuk suatu sistem yang berarti secara utuh, menyeluruh, terpadu sebagai prinsip-prinsip yang mendasar dan berlaku umum (teori) yang mampu menjelaskan rangkaian sebab akibat menyangkut objeknya. Ilmu Kepolisian tersusun secara &nbsp;sistematis dalam rangkaian sebab akibat merupakan sesuatu yang universal. Kebenaran yang hendak dicapai adalah kebenaran universal yang bersifat umum (tidak bersifat tertentu). Ilmu pengetahuan akan hidup tumbuh dan berkembang tatkala memiliki paradigmanya &nbsp;sendiri yang ditunjukkan ontologi, epistimologi, metodologi, dan aksiologinya mantap dan digunakan untuk menangani, mengatasi, menyelesaikan permasalahan, memprediksi, &nbsp;mencegah dan sebagainya sesuai dengan tugasnya masing-masing.\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Dalam perkembangannya para ahli tidak hanya semata-mata mengembangkan ilmu yang menjadi kekhususannya melainkan juga mempunyai perhatian dan mengembangkan bidang-bidang lain, sehingga pinjam meminjam dan menghubung-hubungkan antara satu teori dengan teori yang lain akan menjadi hal yang biasa digunakan dan menjadi antarbidang untuk menemukan sesuatu hal baru. Demikian halnya Ilmu Kepolisian dalam pengembanganyapun mengikuti perubahan-perubahan dari apa yang dikerjakan polisi sebagai crime fighter dan penegak hukum telah berkembang juga menangani masalah- masalah sosial, keteraturan sosial dan isu-isu penting yang terjadi dalam masyarakat, sehingga pendekatan kajiannyapun bergeser dari multibidang menuju &nbsp;pada antarbidang. Ilmu Kepolisian secara umum mengkaji :&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n1.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah sosial.\r\n</div>\r\n<div style="text-align: justify">\r\n2.<span style="white-space: pre" class="Apple-tab-span">	</span>Pengelolaan keteraturan sosial.\r\n</div>\r\n<div style="text-align: justify">\r\n3.<span style="white-space: pre" class="Apple-tab-span">	</span>Isu-isu sosial/isu-isu penting yang terjadi dalam masyarakat.\r\n</div>\r\n<div style="text-align: justify">\r\n4.<span style="white-space: pre" class="Apple-tab-span">	</span>Hukum, keadilan dan penegakkannya.\r\n</div>\r\n<div style="text-align: justify">\r\n5.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah kemanusiaan.\r\n</div>\r\n<div style="text-align: justify">\r\n6.<span style="white-space: pre" class="Apple-tab-span">	</span>Penyelidikan, penyidikan kriminalitas Polisi dan masalah-masalah politik.\r\n</div>\r\n<div style="text-align: justify">\r\n7.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah ideologi.\r\n</div>\r\n<div style="text-align: justify">\r\n8.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah ekonomi.\r\n</div>\r\n<div style="text-align: justify">\r\n9.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah kebudayaan.\r\n</div>\r\n<div style="text-align: justify">\r\n10.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah keamanan.\r\n</div>\r\n<div style="text-align: justify">\r\n11.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah keselamatan.\r\n</div>\r\n<div style="text-align: justify">\r\n12.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah kemanusiaan.\r\n</div>\r\n<div style="text-align: justify">\r\n13.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah birokrasi.\r\n</div>\r\n<div style="text-align: justify">\r\n14.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah perubahan sosial.\r\n</div>\r\n<div style="text-align: justify">\r\n15.<span style="white-space: pre" class="Apple-tab-span">	</span>Masalah-masalah globalisasi.\r\n</div>\r\n<div style="text-align: justify">\r\n16.<span style="white-space: pre" class="Apple-tab-span">	</span>Modernisasi (teknologi kepolisian).\r\n</div>\r\n<div style="text-align: justify">\r\n17.<span style="white-space: pre" class="Apple-tab-span">	</span>Model Polisi dan pola-pola pemolisianya sebagai alternatif gaya pemolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n18.<span style="white-space: pre" class="Apple-tab-span">	</span>Kejahatan dan pola-pola dan perkembangannya.\r\n</div>\r\n<div style="text-align: justify">\r\n<br />\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Selain pengetahuan bagi petugas polisi diperlukan juga skill/ketrampilan dasar/pendukung sebagai petugas polisi yang profesional :&nbsp;\r\n</div>\r\n<div style="text-align: justify">\r\n1.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis dasar fungsi kepolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n2.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis forensik kepolisian.\r\n</div>\r\n<div style="text-align: justify">\r\n3.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis penyelidikan dan penyidikan.\r\n</div>\r\n<div style="text-align: justify">\r\n4.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis pengamanan (private/industri).\r\n</div>\r\n<div style="text-align: justify">\r\n5.<span style="white-space: pre" class="Apple-tab-span">	</span> Teknis-teknis penanganan TKP.\r\n</div>\r\n<div style="text-align: justify">\r\n6.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis senjata dan bahan peledak.\r\n</div>\r\n<div style="text-align: justify">\r\n7.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis penegakan hukum.\r\n</div>\r\n<div style="text-align: justify">\r\n8.<span style="white-space: pre" class="Apple-tab-span">	</span>Teknis-teknis SAR dan penanganan bencana dan sebagainya dapat dikembangkan sesuai kebutuhan/perubahan jaman.\r\n</div>\r\n<div style="text-align: justify">\r\n<br />\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>Selain itu mentalitas dan moralitas penanaman nilai-nilai kebudayaan polisi melalui pola pengasuhan :\r\n</div>\r\n<div style="text-align: justify">\r\n1.<span style="white-space: pre" class="Apple-tab-span">	</span>Fisik dan olah raga.\r\n</div>\r\n<div style="text-align: justify">\r\n2.<span style="white-space: pre" class="Apple-tab-span">	</span>Kesenian dan kebudayaan.\r\n</div>\r\n<div style="text-align: justify">\r\n3.<span style="white-space: pre" class="Apple-tab-span">	</span>Spiritual dan keagamaan.\r\n</div>\r\n<div style="text-align: justify">\r\n4.<span style="white-space: pre" class="Apple-tab-span">	</span>Pola/gaya hidup sehat.\r\n</div>\r\n<div style="text-align: justify">\r\n5.<span style="white-space: pre" class="Apple-tab-span">	</span>Sistem-sistem belajar.\r\n</div>\r\n<div style="text-align: justify">\r\n<br />\r\n</div>\r\n<div style="text-align: justify">\r\n<span style="white-space: pre" class="Apple-tab-span">	</span>(Reff: Ilmu Kepolisian, Sekolah Tinggi Ilmu Kepolisian, Jakarta, PTIK Press.2015)\r\n</div>\r\n</div>\r\n', '2016-02-11', '', 'bhinaya', 4680, '22:40:37', 'Kamis');
INSERT INTO `halamanstatis` (`id_halaman`, `judul`, `judul_seo`, `isi_halaman`, `tgl_posting`, `gambar`, `username`, `dibaca`, `jam`, `hari`) VALUES
(55, 'Pandangan Tentang Ilmu Kepolisian', 'pandangan-tentang-ilmu-kepolisian', '<span style="vertical-align: baseline; background-color: transparent"><font size="2">\r\n</font>\r\n<div>\r\n<font size="2">\r\n</font>\r\n<pre style="text-align: justify">\r\n<font size="2">\r\n<div style="text-align: center">\r\n&nbsp;\r\n</div>\r\n</font><span>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt; text-indent: 28.3pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">Dalam&nbsp;perkembangannya,&nbsp;sejarah&nbsp;membuktikan&nbsp;tugas-tugas&nbsp;penyelenggaraan&nbsp;fungsi&nbsp;kepolisian&nbsp;mau</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">tidak&nbsp;mau&nbsp;harus&nbsp;mampu&nbsp;menjawab&nbsp;perkembangan&nbsp;lingkungan&nbsp;strategis&nbsp;dan&nbsp;harapan&nbsp;masyarakat.&nbsp;Karena</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">fungsi&nbsp;kepolisian&nbsp;adalah&nbsp;fungsional&nbsp;dalam&nbsp;kehidupan&nbsp;manusia&nbsp;bermasyarakat&nbsp;dan&nbsp;bernegara.&nbsp;Fungsi</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">kepolisian&nbsp;harus&nbsp;dilihat&nbsp;dalam&nbsp;perspektif&nbsp;bahwa&nbsp;individu,&nbsp;masyarakat&nbsp;dan&nbsp;negara,&nbsp;masing-masing</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">merupakan&nbsp;sebuah&nbsp;sistem&nbsp;yang&nbsp;secara&nbsp;keseluruhan&nbsp;memproses&nbsp;masukan-masukan&nbsp;program&nbsp;pembangunan</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">untuk&nbsp;menghasilkan&nbsp;keluaran&nbsp;berupa&nbsp;kemakmuran,&nbsp;keadilan,&nbsp;dan&nbsp;kesejahteraan.&nbsp;Dalam&nbsp;proses&nbsp;demikian,</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">maka&nbsp;fungsi&nbsp;kepolisian&nbsp;bertugas&nbsp;untuk&nbsp;menjaga&nbsp;agar&nbsp;keluaran&nbsp;yang&nbsp;diharapkan&nbsp;sesuai&nbsp;dengan&nbsp;tujuan&nbsp;yang</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">ingin&nbsp;dicapai&nbsp;dan&nbsp;menjaga&nbsp;agar&nbsp;individu,&nbsp;masyarakat&nbsp;dan&nbsp;negara&nbsp;yang&nbsp;merupakan&nbsp;unsur-unsur&nbsp;utama&nbsp;dalam</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">proses&nbsp;tersebut&nbsp;tidak&nbsp;terganggu&nbsp;atau&nbsp;dirugikan.&nbsp;Sebab&nbsp;setiap&nbsp;gangguan&nbsp;hanya&nbsp;akan&nbsp;mengakibatkan&nbsp;tidak</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">tercapainya&nbsp;hasil&nbsp;keluaran&nbsp;yang&nbsp;diharapkan.</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt; text-indent: 28.3pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">Berikut&nbsp;ini&nbsp;akan&nbsp;dijelaskan&nbsp;beberapa&nbsp;pendapat,&nbsp;pandangan,&nbsp;dan&nbsp;pemahaman&nbsp;Ilmu&nbsp;Kepolisian&nbsp;dari</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">para&nbsp;tokoh&nbsp;ilmuwan&nbsp;dan&nbsp;pemerhati&nbsp;kepolisian.&nbsp;Tentunya,&nbsp;pendapat&nbsp;tersebut&nbsp;sangat&nbsp;dipengaruhi&nbsp;oleh&nbsp;latar</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">belakang&nbsp;keilmuan,&nbsp;keluasan&nbsp;pengalaman&nbsp;dan&nbsp;kedalaman&nbsp;pemahaman&nbsp;atas&nbsp;masalah-masalah&nbsp;yang</span>\r\n</p>\r\n<p style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 17.35pt" dir="ltr">\r\n<span style="font-size: 13.3333px; font-family: Calibri; vertical-align: baseline; white-space: pre-wrap; background-color: transparent">berkaitan&nbsp;dengan&nbsp;kepolisian.</span>\r\n</p>\r\n</span><font size="2">\r\n<div style="text-align: justify">\r\n&nbsp;\r\n</div>\r\n</font>\r\n</pre>\r\n</div>\r\n</span>\r\n', '2016-02-11', '', 'bhinaya', 65, '19:50:10', 'Kamis');
